(1, 'Participation à la formation des agents du Projet EJASA de SNV sur maitrise des outils de gestion de newsletter et des réseaux sociaux', 'participation-a-la-formation-des-agents-du-projet-ejasa-de-snv-sur-maitrise-des-outils-de-gestion-de-newsletter-et-des-reseaux-sociaux', '-', 'Sur invitation de la société \"Les Angles d\'Afrique\", nous avons participé du 7 au 8 Octobre à un Atelier de formation des agents du projet SNV-EJAS à l\'hôtel SAKA KINA de Kandi.', '<p><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"></span></p><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Démarrée vers 10H, dans la matinée du Jeudi 7 Octobre 2021, le module de formation dont nous avons la charge de diriger a connu n léger retard d’une heure. Après la présentation des formateurs été des participants, nous avons procédé à la présentation du planning des deux jours de formation.</div><div dir=\"auto\" style=\"text-align: start;\"><br></div></div><p></p><h3><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Journée du Jeudi 7 Octobre 2021</div></div></span></h3><p><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"></span></p><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Pendant cette journée, il a été question de faire découvrir aux participants, ce que c’est qu’une Newsletter, ses composantes, ses avantages et comment la mettre en place de façon efficace.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Pour permettre aux participants de bien maitriser le volet théorie, nous avons effectué des travaux pratiques avec la plateforme SendinBlue (<span><a class=\"oajrlxb2 g5ia77u1 qu0x051f esr5mh6w e9989ue4 r7d6kgcz rq0escxv nhd2j8a9 nc684nl6 p7hjln8o kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x jb3vyjys rz4wbd8a qt6c0cv9 a8nywdso i1ao9s8h esuyzwwr f1sip0of lzcic4wl py34i1dx gpro0wi8\" href=\"https://l.facebook.com/l.php?u=http%3A%2F%2Fwww.sendinblue.com%2F%3Ffbclid%3DIwAR27qo9Dr7TMjwLsqb9R7fBdjjswBAI1e2leBSxWyQYvhUmTwTB7FFSVVwQ&amp;h=AT3ZSjQT3AIjaMhQFHE5-4clmimC9yOAAdoTntlXiJqyf4HQgbWL6ZxXxVlKDgB7HvZdtO83o0DUYc6gscxwc6eGoVrlotNYPxFgqxFBweMiEj-jH9mpqslTUQh9lnlgA7XN&amp;__tn__=-UK-R&amp;c[0]=AT2l_OQPs8-Kwy-xSi31KIE6fvt9Cj93MWY68DiFkw1RAB0rtdTx_n2_rabwvriHSOYlBgp0zasM5EgWPtDUJFmJMsdsDhVRCiVuZ9hV3OBEr2LIMJdlR8PoRIu44R-T3moCs_uuMp2-9jHrDy57Mb5xiDQ4UC1V6MqOHVAKt8Vr0KL96xskD00p1892WfKCICxYeTc\" rel=\"nofollow noopener\" role=\"link\" tabindex=\"0\" target=\"_blank\">www.sendinblue.com</a></span>). Cette plateforme nous a permis dans la soirée du Jeudi de créer un modèle de Newsletter, de créer une liste de Newsletter et de programmer l’envoie de la newsletter aux groupes de contacts crées.</div><div dir=\"auto\" style=\"text-align: start;\"><br></div></div><p></p><h3><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><b>Journée du Vendredi 8 Octobre 2021</b></div></div></span></h3><p><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"></span></p><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Cette journée a été consacrée à deux volets de notre module :</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">la publication du contenu sur les réseaux sociaux et la création de contenus avec la plateforme <span><a class=\"oajrlxb2 g5ia77u1 qu0x051f esr5mh6w e9989ue4 r7d6kgcz rq0escxv nhd2j8a9 nc684nl6 p7hjln8o kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x jb3vyjys rz4wbd8a qt6c0cv9 a8nywdso i1ao9s8h esuyzwwr f1sip0of lzcic4wl py34i1dx gpro0wi8\" href=\"https://l.facebook.com/l.php?u=https%3A%2F%2FCanva.com%2F%3Ffbclid%3DIwAR3oJDfJFvcNfAwldthv4QkOFBmd8w2ViINnRZ8KS0HxvvkogOJ7pcBD0u4&amp;h=AT1hjiE1b8lcZldBMv3_HgB9JWeNwL901BfvzjX8bZuQBQjLI9Z_NPlrRKnP3ozfWkwBBFwTs6256pWxlFhrTtzCJB71epvdYiF9jcwMpPfj9enVO-O-mqpjcvh6ifD1TZM8&amp;__tn__=-UK-R&amp;c[0]=AT2l_OQPs8-Kwy-xSi31KIE6fvt9Cj93MWY68DiFkw1RAB0rtdTx_n2_rabwvriHSOYlBgp0zasM5EgWPtDUJFmJMsdsDhVRCiVuZ9hV3OBEr2LIMJdlR8PoRIu44R-T3moCs_uuMp2-9jHrDy57Mb5xiDQ4UC1V6MqOHVAKt8Vr0KL96xskD00p1892WfKCICxYeTc\" rel=\"nofollow noopener\" role=\"link\" tabindex=\"0\" target=\"_blank\">Canva.com</a></span> </div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Nous avons abordé dans un premier temps, la partie « publication sur les réseaux sociaux » avant de terminer avec la plateforme <span><a class=\"oajrlxb2 g5ia77u1 qu0x051f esr5mh6w e9989ue4 r7d6kgcz rq0escxv nhd2j8a9 nc684nl6 p7hjln8o kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x jb3vyjys rz4wbd8a qt6c0cv9 a8nywdso i1ao9s8h esuyzwwr f1sip0of lzcic4wl py34i1dx gpro0wi8\" href=\"https://l.facebook.com/l.php?u=https%3A%2F%2FCanva.com%2F%3Ffbclid%3DIwAR0fp8TYchIDH3637Ubtdu2649hZ2xsCSY5kxgyGRvy0RICX6u3So4f6UQE&amp;h=AT1hjiE1b8lcZldBMv3_HgB9JWeNwL901BfvzjX8bZuQBQjLI9Z_NPlrRKnP3ozfWkwBBFwTs6256pWxlFhrTtzCJB71epvdYiF9jcwMpPfj9enVO-O-mqpjcvh6ifD1TZM8&amp;__tn__=-UK-R&amp;c[0]=AT2l_OQPs8-Kwy-xSi31KIE6fvt9Cj93MWY68DiFkw1RAB0rtdTx_n2_rabwvriHSOYlBgp0zasM5EgWPtDUJFmJMsdsDhVRCiVuZ9hV3OBEr2LIMJdlR8PoRIu44R-T3moCs_uuMp2-9jHrDy57Mb5xiDQ4UC1V6MqOHVAKt8Vr0KL96xskD00p1892WfKCICxYeTc\" rel=\"nofollow noopener\" role=\"link\" tabindex=\"0\" target=\"_blank\">Canva.com</a></span></div><div dir=\"auto\" style=\"text-align: start;\"><span><br></span></div></div><p></p><h4><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Utilisation de LinkedIn dans le cadre professionnel</div></div></span></h4><p><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"></span></p><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Sur doléance des participant, notre attention s’est focalisée sur le réseau social LinkedIn à cause de son aspect professionnel. Une présentation de l’objectif de la plateforme, des usages, des types de contenus disponible ainsi que de comment créer ces contenus a été présenté. Chacun des participants avait créé un compte sur la plateforme et a testé les différentes fonctionnalités disponibles. Après une séance de question réponses, nous avions clôturé cette section avant de passer à la création de contenus.</div><div dir=\"auto\" style=\"text-align: start;\"><br></div></div><p></p><h4><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><b>La création de contenus avec Canva</b></div></div></span></h4><p><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"></span></p><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Nous avons démarré cette partie de la formation après la pause de 10H. Une brève présentation de la plateforme Canva a été faite avant d’attaquer la phase pratique. Sur demande des participants, nous avons eu à reproduire la Newsletter réalisée dans la plateforme SendinBlue. L’objectif est d’apprendre l’usage du logiciel et d’avoir une version PDF de la Newsletter. Nous avions ensuite fait une présentation de quelques plateformes où l’on peut trouver de belles images afin d’agrémenter ses créations dans Canva. Le dernier volet avec la plateforme Canva a porté sur un TP pratique sur la création d’une Affiche de formation en Informatique en se basant sur des modèles existants. </div><div dir=\"auto\" style=\"text-align: start;\"><br></div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"> C’est après cette phase de la formation que nous avions clôturé la session aux environs de 15heures à la grande satisfaction des participants.</div><div dir=\"auto\" style=\"text-align: start;\"><br></div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Les photos de la formation sont disponibles ici : <span><a class=\"oajrlxb2 g5ia77u1 qu0x051f esr5mh6w e9989ue4 r7d6kgcz rq0escxv nhd2j8a9 nc684nl6 p7hjln8o kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x jb3vyjys rz4wbd8a qt6c0cv9 a8nywdso i1ao9s8h esuyzwwr f1sip0of lzcic4wl py34i1dx gpro0wi8\" href=\"https://www.flickr.com/photos/194179706@N06/albums/72157720032737226?fbclid=IwAR1RnbRs2wDLU143T2uGDlOg7L88zYNOs5Mp7_jjNt3g_V6iHM_ujd2fY38\" rel=\"nofollow noopener\" role=\"link\" tabindex=\"0\" target=\"_blank\">https://www.flickr.com/.../19417.../albums/72157720032737226</a></span></div></div><p></p>', 2, './storage/disk/activites/participat_713993.jpg', 44, 1, 1, '2021-10-29 08:28:10', '2022-12-04 12:44:05', NULL),
(2, 'Appel à exposition pour la foire aux start-up dans le cadre des Résidences Numériques', 'appel-a-exposition-pour-la-foire-aux-start-up-dans-le-cadre-des-residences-numeriques', '-', 'Dans le cadre des activités de l\'édition 2021 des Résidences du Numérique, le comité d\'organisation de l\'évènement lance un appel à exposition pour la foire aux start-up. Il s\'agit des startups résidents dans les 4 villes retenues', '<p><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d9wwppkn fe6kdd0r mau55g9w c8b282yb mdeji52x e9vueds3 j5wam9gi b1v8xokw m9osqain hzawbc8m\" dir=\"auto\"><span id=\"jsc_c_3s\"><span class=\"jpp8pzdo\"><span><span aria-hidden=\"true\"></span></span></span><span class=\"g0qnabr5\"><span class=\"tojvnm2t a6sixzi8 abs2jz4q a8s20v7p t1p8iaqh k5wvi7nf q3lfd5jv pk4s997a bipmatt0 cebpdrjk qowsmv63 owwhemhu dp1hu0rb dhp61c6y iyyx5f41\"><span class=\"q9uorilb l9j0dhe7 bk00n993\"><svg viewBox=\"0 0 16 16\" width=\"1em\" height=\"1em\" class=\"a8c37x1j ms05siws hwsy1cff b7h9ocf4 em6zcovv cyypbtt7 fwizqjfa\" title=\"Partagé avec Public\"><g fill-rule=\"evenodd\" transform=\"translate(-448 -544)\"></g></svg><br><br></span></span></span></span></span></p><div class=\"\" dir=\"auto\"><div class=\"ecm0bbzt hv4rvrfc ihqw7lf3 dati1w0a\" data-ad-comet-preview=\"message\" data-ad-preview=\"message\" id=\"jsc_c_3t\"><div class=\"j83agx80 cbu4d94t ew0dbk1b irj2b8pg\"><div class=\"qzhwtbm6 knvmm38d\"><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"><div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"></span><br></div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Dans le but de sélectionner les exposants, participants à la foire aux startups dans le cadre des Résidences Numériques qui se tiendra à Parakou, Bohicon, Abomey-Calavi et Porto-Novo, un appel à exposition du 26 octobre au 10 novembre 2021est lancé.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"✅\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tba/1.5/16/2705.png\" width=\"16\" height=\"16\"></span> Vous êtes une Start-up ayant une solution avérée </div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"✅\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tba/1.5/16/2705.png\" width=\"16\" height=\"16\"></span> Vous êtes une Entreprise offrant des produits ou services dans le secteur du numérique</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"✅\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tba/1.5/16/2705.png\" width=\"16\" height=\"16\"></span> Vous êtes une association ou ONG intervenant dans la promotion du numérique, de l’entrepreneuriat ou de l’employabilité des jeunes.</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"✅\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tba/1.5/16/2705.png\" width=\"16\" height=\"16\"></span> Vous êtes un Tech hub, Espace de coworking, fablab, tiers lieu.</div><div dir=\"auto\" style=\"text-align: start;\"><br></div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Vous souhaitez participer à une foire pour exposer vos solutions, produits, services et activités à un large public composé de cadre d’entreprises, d’organisations, de partenaires financiers, d’étudiants, d’investisseurs </div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><br></span></div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><br></span>Inscrivez-vous au plus tard le 10 novembre pour réserver votre stand sur <span><a class=\"oajrlxb2 g5ia77u1 qu0x051f esr5mh6w e9989ue4 r7d6kgcz rq0escxv nhd2j8a9 nc684nl6 p7hjln8o kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x jb3vyjys rz4wbd8a qt6c0cv9 a8nywdso i1ao9s8h esuyzwwr f1sip0of lzcic4wl py34i1dx gpro0wi8\" href=\"https://vu.fr/AppelExposition?fbclid=IwAR08aXWRw3En510M18S14f7OpiBJF1fDd-lx0HxoFzRlG1bIXnfKcKftukY\" rel=\"nofollow noopener\" role=\"link\" tabindex=\"0\" target=\"_blank\">https://vu.fr/AppelExposition</a></span></div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span></span><span><br></span></div></div></span></div></div></div></div>', 1, './storage/disk/activites/appel-a-ex_596739.webp', 85, 1, 1, '2021-10-29 09:59:59', '2022-12-09 22:59:46', NULL),
(3, 'Atelier de présentation des parcours de renforcement de capacités des Structures d\'Accompagnement en Entreprenariat Innovant(SAEI)', 'atelier-de-presentation-des-parcours-de-renforcement-de-capacites-des-structures-daccompagnement-en-entreprenariat-innovantsaei', '-', 'Dans le cadre du projet DigiBoost, les SAEI ont été conviées dans les locaux de l\'Hôtel Novotel du 14 au 15 Octobre 2021 par la faitière des SAEI en Afrique dénommée Afric\'Innov.', '<p>Nous avons participé du 14 au 15 Octobre 2021 dernier à un Atelier organisé par Afric\'Innov. Cet atelier entre dans le cadre du projet DigiBoost qui a pour objectif, la restructuration des Structures D’Accompagnement à l\'Entreprenariat Innovant (SAEI). Cet atelier a réuni une trentaine de SAEI venant des 4 coins du Bénin. Odacesoft s\'est fait également représenté à cet événement. <br><br>Il était question pour les participants de prendre connaissance des modules de renforcement de capacité prévus dans le cahier de charges du projet, de faire des suggestions en fonction des difficultés rencontrés et des besoins sur le terrain.<br><br>La première journée a été consacrée aux modules compétences nécessaires au Chargé de programme des SAEI et la Seconde journée consacrée au fondateur des SAEI.<br><br>La prochaine étape consistera à la sélection de 20 SAEI pouvant bénéficier de ce programme de formation prévue pour démarrer en debut du mois de Novembre prochain.<br><br>Ce fut un atelier de partage et de collaboration très enrichissant. Ce projet vient à point nommé dans une société où l\'accompagnement des jeunes entrepreneurs reste à structurer afin que sortent de nos SAEI des Startups de renom.<br><br>C\'est l\'occasion pour de remercier Enabel et les autres partenaires techniques et financiers ainsi que l\'équipe de #DigiBoost, Afric\'Innov,... pour l\'effort qu\'ils fournissent chaque jour pour accompagner la professionnalisation des SAEI. <br><br>Les photos de cet atelier sont disponibles ici : <a href=\"https://flic.kr/s/aHsmWVx4qu\" target=\"_blank\">https://flic.kr/s/aHsmWVx4qu</a><br></p>', 1, './storage/disk/activites/atelier-de_582153.jpg', 50, 1, 1, '2021-10-29 11:41:22', '2022-11-26 09:13:37', NULL),
(4, 'Sélection de jeunes Geeks (Developpeur, Electronicien, web designer, etc) A Parakou, Bohicon, Porto-Novo et Abomey-Calavi dans le cadre des Résidences Numérique', 'selection-de-jeunes-geeks-developpeur-electronicien-web-designer-etc-a-parakou-bohicon-porto-novo-et-abomey-calavi-dans-le-cadre-des-residences-numerique', '-', 'Dans le cadre des activités des Résidences du Numérique, nous lançon un appel à sélection de jeunes geeks talentueux afin de faire valoir leurs compétences au cours de cette activité.', '<p>Cette sélection de geeks s\'inscrit dans le cadre de l\'accompagnement des\n équipes candidates au challenge de solutions innovantes qui s\'organise \ndans le cadre des \'\'Résidences Numeriques\'\' 2ème édition. <br><br>En \neffet, après une absence en 2020, en raison de la crise sanitaire, les \nrésidences numériques reviennent en 2021 dans plusieurs villes, avec la \ncollaboration de ODACE SOFT à Parakou, SENS Bénin, Hello booster et \nCarrefour lab à Bohicon, à Porto-Novo avec le LABIS Porto-Novo et à \nCalavi avec Kolawolé Photography.<br><br>Ouvert aux startup, \nentrepreneurs, women in Tech, geek, étudiants et à toutes autres \npersonnes passionnées de l’entrepreneuriat et du numérique, les \nRésidences Numériques 2021 se veut des journées de création, d’échanges,\n formation et de promotion de solutions innovantes portées par les \nstartups du Bénin. Elles se tiendront à Parakou du 11 au 13 novembre \n2021 ; Bohicon du 18 au 20 novembre 2021 ; à Porto-Novo et Calavi du 25 \nau 27 novembre 2021.</p>', 1, './storage/disk/activites/selection-_209668.jpg', 44, 1, 1, '2021-10-29 11:58:50', '2022-12-06 00:09:04', NULL),
(5, 'Participation à l\'atelier de présentation de la plateforme Digiboost.bj', 'participation-a-latelier-de-presentation-de-la-plateforme-digiboostbj', '-', 'Du 10 au 13 Octobre 2021, nous avons participé à un atelier de  présentation et d’appropriation de la plateforme web DigiBoost. Cet atelier a eu lieu à  GANNA Hôtel situé à Grand-Popo.', '<p>PARTICIPATION À L\'ATELIER DE PRÉSENTATION DE LA PLATEFORME DIGIBOOST<br><br>&nbsp;<br><br>Pendant trois jours, nous avons passé en revu la nouvelle plate-forme mise en place par le projet #DigiBoost qui est un véritable outil de suivi des actions menées par les Structures d\'Accompagnement à l\'Entreprenariat Innovant (SAEI).&nbsp; C\'était l\'occasion de découvrir les différentes fonctionnalités de cette plate-forme, notamment :<br><br>💥 Le processus de création et de validation de compte &nbsp;<br><br>💥 Le processus de Création et de Validation de SAEI, Startup,... <br><br>💥 La prise en main du tableau et le remplissage du profil des SAEI par l\'administrateur<br><br>💥 Le remplissage du profil de la SAEI <br><br>💥 La création et la gestion des articles, des programmes, des projets, des événements, des activités, des formulaires,...<br><br>Plusieurs suggestions ont été soumis par les participants et ont ensuite été intégrées par l\'équipe technique de ITNum qui a eu la charge de développer cette plateforme. D\'autres suggestions sont à intégrer dans les prochains jours.<br><br>La plupart des SAEI présente ont créé un compte et rempli un certain nombre de données afin de permettre la mise en production de la plateforme avec des données réelles. <br><br>L\'équipe technique a pris la résolution de rester à l\'écoute de nouvelles suggestions afin de parfaire le travail afin de faire de cette plateforme un véritable outil de travail et d\'accompagnement des structures d\'accompagnement au Bénin et en Afrique.<br><br>Il faut rappeler que cette plateforme est déjà hébergé et disponible en ligne sur l\'URL: https://digiboost.bj<br><br>L\'atelier a pris fin, le Mercredi 13 Octobre aux environs de 14 par un des applaudissements à l\'endroit du projet DigiBoost, de l\'équipe Technique et des Bénéficiaires que constituent les SAEI suivi d\'une photo de Famille.<br><br>Les photos de l\'événement sont disponibles ici :<br><a href=\"https://flic.kr/ps/3XAdBL\" target=\"_blank\">https://flic.kr/ps/3XAdBL</a><br><br>#Odacesoft #DigiBoost #Enabel #PlateformeDigiboost<br></p>', 1, './storage/disk/activites/participat_805252.webp', 70, 1, 1, '2021-10-29 12:18:48', '2022-12-04 06:35:09', NULL);
INSERT INTO `activites` (`id`, `title`, `slug`, `statut`, `lead`, `content`, `temps`, `img`, `view_count`, `user_id`, `actif`, `created_at`, `updated_at`, `deleted_at`) VALUES
(8, 'Participation de Odacesoft à l\'atelier de restitution et d\'évaluaion des programmes de formation en Anglais des SAEI', 'participation-de-odacesoft-a-latelier-de-restitution-et-devaluaion-des-programmes-de-formation-en-anglais-des-saei', '-', 'Odacesoft, représenté par son fondateur monsieur Wilfried ETEKA a participé à l\'atelier restitution du diagnostic et d\'évaluation des programmes de formation en Anglais des SAEI', '<p><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 fe6kdd0r mau55g9w c8b282yb d3f4x2em iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"></span></p><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: center;\"><b><i><br></i></b></div><div dir=\"auto\" style=\"text-align: start;\">Initié\n par dans le Cadre du projet DigiBoost, cet atelier&nbsp; a eu lieu à \nGrand-Popo, du 7 au 9 Décembre 2021 et a pour objectif d\'évaluer le \nbesoin des SAEI( Structures d\'Accompagnement à l\'Entreprenariat \nInnovant) en terme d\'usage de la langue Anglaise en vue d\'élaborer un \ncurricula qui permettra de mettre en œuvre le processus de formation des\n dirigeants de SAEI sélectionnés. </div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Une\n vingtaine de SAEI ont pris part à cet événement qui a permis dans un \npremier temps, d\'identifier les besoins des dirigeants et du personnel \ndes SAEI, de proposer un plan de formation et ensuite d\'établir un \nChronogramme de déroulement de ce programme. Il faut noter que c\'est le \nCabinet LEARNING LAB qui a la charge de dérouler se programme de \nformation de 3 Cohortes qui va se dérouler sur neuf (9) mois à raison de\n trois (3) mois par cohorte.</div><div dir=\"auto\" style=\"text-align: start;\"><br></div><div dir=\"auto\" style=\"text-align: start;\"> </div><div dir=\"auto\" style=\"text-align: start;\"><img src=\"data:image/jpeg;base64,\" style=\"width: 799px;\" data-filename=\"51736010772_a9a000ebf8_c.jpg\"></div><div dir=\"auto\" style=\"text-align: start;\"><br></div><div dir=\"auto\" style=\"text-align: start;\"><div dir=\"auto\" style=\"text-align: center;\"><span style=\"font-weight: bolder;\"><i>[Odacesoft représenté par son Directeur au niveau de l\'atelier]</i></span></div><div dir=\"auto\"><br></div></div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">La\n formation se déroulera en ligne via les plateformes de visioconférence \nconnues (Zoom, Skype,...) à raison de deux séances par semaines avec des\n exercices quotidiens. </div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">C\'était\n l\'occasion aussi d\'initier les participants à la phonétique des mots \nanglais, mais également à l\'initiation de conversations en vue de \nmaîtrise cette langue qui deviendra dans les prochains mois, un outil de\n travail pour chaque structure d\'accompagnement. La première cohorte de \ncette formation débutera sa formation à partir du 03 janvier 2022.</div><div dir=\"auto\" style=\"text-align: start;\"><br></div><div dir=\"auto\" style=\"text-align: start;\">Le contenu de la formation sera mis en ligne sur la plateforme <a href=\"http://www.digiboost.bj\" target=\"_blank\">www.digiboost.bj</a> qui regroupe tous les acteurs de écosystème de l\'entreprenariat numérique au Bénin. Découvre le les photos de l\'événement ici : <span><a class=\"oajrlxb2 g5ia77u1 qu0x051f esr5mh6w e9989ue4 r7d6kgcz rq0escxv nhd2j8a9 nc684nl6 p7hjln8o kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x jb3vyjys rz4wbd8a qt6c0cv9 a8nywdso i1ao9s8h esuyzwwr f1sip0of lzcic4wl gpro0wi8 py34i1dx\" href=\"https://flic.kr/s/aHsmXey6zp?fbclid=IwAR0qYZs2VT6A76S-z_nZytfWf-7woEBkXAEa1AXV7rfKj5BLJng8qLemIWM\" rel=\"nofollow noopener\" role=\"link\" tabindex=\"0\" target=\"_blank\">https://flic.kr/s/aHsmXey6zp</a></span></div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span><a class=\"oajrlxb2 g5ia77u1 qu0x051f esr5mh6w e9989ue4 r7d6kgcz rq0escxv nhd2j8a9 nc684nl6 p7hjln8o kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x jb3vyjys rz4wbd8a qt6c0cv9 a8nywdso i1ao9s8h esuyzwwr f1sip0of lzcic4wl gpro0wi8 q66pz984 b1v8xokw\" href=\"https://web.facebook.com/hashtag/odacesoft?__eep__=6&amp;__cft__[0]=AZX1ZzelQh9tl03NwBfF79c6_o-m8zm8N55YThCKGK4AiUao_ELfJ95yx_cSu3tXhmYfF7IlvEz1FJuc7pGpZx6lmgUGYT8Rk27HRMOVsfnm-HWFCKxQeMINn4aZV_kNzlAsSrvu9xPUXECUVOoePIvOnReJ6HhQh5kFnaRt3WvetQ&amp;__tn__=*NK-R\" role=\"link\" tabindex=\"0\">#Odacesoft</a></span> <span><a class=\"oajrlxb2 g5ia77u1 qu0x051f esr5mh6w e9989ue4 r7d6kgcz rq0escxv nhd2j8a9 nc684nl6 p7hjln8o kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x jb3vyjys rz4wbd8a qt6c0cv9 a8nywdso i1ao9s8h esuyzwwr f1sip0of lzcic4wl gpro0wi8 q66pz984 b1v8xokw\" href=\"https://web.facebook.com/hashtag/digiboost?__eep__=6&amp;__cft__[0]=AZX1ZzelQh9tl03NwBfF79c6_o-m8zm8N55YThCKGK4AiUao_ELfJ95yx_cSu3tXhmYfF7IlvEz1FJuc7pGpZx6lmgUGYT8Rk27HRMOVsfnm-HWFCKxQeMINn4aZV_kNzlAsSrvu9xPUXECUVOoePIvOnReJ6HhQh5kFnaRt3WvetQ&amp;__tn__=*NK-R\" role=\"link\" tabindex=\"0\">#DigiBoost</a></span> <span><a class=\"oajrlxb2 g5ia77u1 qu0x051f esr5mh6w e9989ue4 r7d6kgcz rq0escxv nhd2j8a9 nc684nl6 p7hjln8o kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x jb3vyjys rz4wbd8a qt6c0cv9 a8nywdso i1ao9s8h esuyzwwr f1sip0of lzcic4wl gpro0wi8 q66pz984 b1v8xokw\" href=\"https://web.facebook.com/hashtag/learninglab?__eep__=6&amp;__cft__[0]=AZX1ZzelQh9tl03NwBfF79c6_o-m8zm8N55YThCKGK4AiUao_ELfJ95yx_cSu3tXhmYfF7IlvEz1FJuc7pGpZx6lmgUGYT8Rk27HRMOVsfnm-HWFCKxQeMINn4aZV_kNzlAsSrvu9xPUXECUVOoePIvOnReJ6HhQh5kFnaRt3WvetQ&amp;__tn__=*NK-R\" role=\"link\" tabindex=\"0\">#LearningLab</a></span> <span><a class=\"oajrlxb2 g5ia77u1 qu0x051f esr5mh6w e9989ue4 r7d6kgcz rq0escxv nhd2j8a9 nc684nl6 p7hjln8o kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x jb3vyjys rz4wbd8a qt6c0cv9 a8nywdso i1ao9s8h esuyzwwr f1sip0of lzcic4wl gpro0wi8 q66pz984 b1v8xokw\" href=\"https://web.facebook.com/hashtag/learningenglish?__eep__=6&amp;__cft__[0]=AZX1ZzelQh9tl03NwBfF79c6_o-m8zm8N55YThCKGK4AiUao_ELfJ95yx_cSu3tXhmYfF7IlvEz1FJuc7pGpZx6lmgUGYT8Rk27HRMOVsfnm-HWFCKxQeMINn4aZV_kNzlAsSrvu9xPUXECUVOoePIvOnReJ6HhQh5kFnaRt3WvetQ&amp;__tn__=*NK-R\" role=\"link\" tabindex=\"0\">#LearningEnglish</a></span></div></div><p><br><br><br></p>', 2, './storage/disk/activites/participat_351245.jpg', 69, 1, 1, '2021-12-19 08:41:52', '2022-12-01 07:27:19', NULL);
INSERT INTO `activites` (`id`, `title`, `slug`, `statut`, `lead`, `content`, `temps`, `img`, `view_count`, `user_id`, `actif`, `created_at`, `updated_at`, `deleted_at`) VALUES
(9, 'Participation effective de Odacesoft aux activités de la deuxième édition des Résidences Numériques', 'participation-effective-de-odacesoft-aux-activites-de-la-deuxieme-edition-des-residences-numeriques', '-', 'L\'événement \"Résidences Numériques\" est un évènement national organisé chaque année par Waxangari L@bs.', '<p><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 fe6kdd0r mau55g9w c8b282yb d3f4x2em iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\">Cet événement a pour objectif de promouvoir l\'entreprenariat innovant à travers des séances de partage, de formation, de création et de challenges entre les porteurs de projets.<br></span></p><p><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 fe6kdd0r mau55g9w c8b282yb d3f4x2em iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\">L’entrepreneuriat digital est au centre de la deuxième journée des Résidences Numériques.</span> La deuxième édition a eu lieu dans 4 différentes villes du Bénin :<br></p><p>✅ Porto-Novo : du 25 au 27 Novembre 2021<br>Thème : Numérique, tourisme, industrie culturelles et créatives.<br><br>✅ Abomey-Calavi : du 25 au 27 Novembre 2021<br>Thème\n : L\'e-tourisme, les industries culturelles et créatives: une \nopportunité pour la promotion culturelle, touristique et l\'employabilité\n des jeunes.<br><br>✅ Bohicon : du 18 au 20 Novembre 2021<br>Thème : Exploiter le numérique pour transformer l\'agriculture et l\'employabilité des jeunes.</p><p><br>✅ Parakou : du 2 au 4 Décembre 2021<br>Thème : L\'eco-tourisme/Culture et l\'e-agriculture : quelles opportunités pour l\'employabilité des jeunes ?</p><p><br></p><p>Cet\n événement a connu le soutien de plusieurs structures notamment parmi \nlesquels on peut citer : Solidarité Laïque, Hello Booster, Guerra Tech \nHub, Light Innovation, Women In Tech Bénin, Aide et Action, Labis, le \nCentre OUADADA, RADEB, la Mairie d\'Abomey-Calavi, Odacesoft, EtriLabs, \nKolawoléAtcho Photographie, 2MG Consulting, L\'envol, MegaTech, \nFoodForAll, IA INNOV\'Activ, l\'université d\'Abomey-Calavi, l\'université \nde Parakou, la FNEB, LA FNEUP, L\'UNEUP, CARREFOUR LAB, FBC,... et \nplusieurs autres partenaires. Plusieurs entrepreneurs et porteurs de \nprojets ont également participé au challenge organisé au niveau de \nchaque ville afin de remporter les prix mis à leur disposition.<br>Odacesoft\n a eu l\'occasion de participer aux activités des Résidences Numériques \norganisées à Parakou par la voix de son fondateur, monsieur Wilfried \nETEKA.<br>Il a fait partie des membres du jury qui ont jugé de la \nqualité du travail effectué par les entrepreneurs et porteurs de \nprojets. Il a également animé une Keynote sur la thématique \" Quelle \néducation pour une vraie inclusion numérique \" et une formation sur \nFormation: \"comment créer et développer une entreprise dans le domaine \ndu numérique.\"<br><br>Les différentes activités de la deuxième édition \ndes Résidences étaient riches en sons et en couleurs, avec le soutien du\n projet DigiBoost mise en œuvre par Enabel, l\'agence française de \ndéveloppement (AFD), l\'Union Européenne et bien d\'autres partenaires.</p><p><br>#Odacesoft #ResidencesNumeriques #Entreprenariat #BéninNumérique</p><p></p>', 2, './storage/disk/activites/participat_577822.jpg', 68, 1, 1, '2021-12-19 09:00:39', '2022-12-12 20:53:19', NULL),
(10, 'Formation des administrateurs des administrateurs des réseaux sociaux sur le fact-checking à Djougou et Bassila', 'formation-des-administrateurs-des-administrateurs-des-reseaux-sociaux-sur-le-fact-checking-a-djougou-et-bassila', '-', 'L\'ONG SIA N\'SON - DC à initié  une séance de communication  sur la vaccination contre  COVID-19 et le fact - Checking  à l\'endroit des administrateurs de groupes WhatsApp dans les communes de Djougou et Bassila', '<p><p>\r\n\r\n</p><p class=\"MsoBodyText\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:18.0pt\"><span style=\"mso-bidi-font-size:18.0pt;font-family:Montserrat;\r\nmso-bidi-font-weight:bold\">La pandémie liée au Covid-19 a connu depuis la fin\r\nde l’année 2019, une montée vertigineuse du nombre de cas d’abord dans la\r\npartie méridionale du Bénin avant de s’étendre dans les autres départements du\r\npays. La flambée du nombre de cas enregistrés dans les deux départements. Il\r\ns’agit essentiellement de l’instauration des gestes barrières en vue <b>de\r\nlimiter les contacts entre personnes</b>. Ainsi, plusieurs moyens ont été mis\r\nen branle pour réduire considérablement les contacts. Au nombre de ceux-ci on\r\npeut citer par exemple <b>l’utilisation de l’internet</b>. Avec l’internet, les\r\nactivités qui nécessitaient des regroupements de personnes sont rendues\r\npossibles grâce aux vidéos conférences par exemple.</span></p>\r\n\r\n<p class=\"MsoBodyText\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"mso-bidi-font-size:18.0pt;font-family:Montserrat;mso-bidi-font-weight:\r\nbold\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoBodyText\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:36.0pt\"><span style=\"mso-bidi-font-size:18.0pt;font-family:Montserrat;\r\nmso-bidi-font-weight:bold\">De nombreuses actions sont menées par nos\r\ngouvernants, les organisations de la société civile depuis l’année 2020 afin de\r\njuguler cette pandémie. Pour se protéger, le respect des gestes barrières et le\r\nchoix d’une vaccination sont offerts à toute la population Béninoise. La\r\nvaccination est gratuite et accessible au plus de 18 ans. </span></p>\r\n\r\n<p class=\"MsoBodyText\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:36.0pt\"><span style=\"mso-bidi-font-size:18.0pt;font-family:Montserrat;\r\nmso-bidi-font-weight:bold\">La propagation du coronavirus <i>SARS-CoV2 (</i>Covid-19)<i>\r\n</i>observée dans le monde dès le début 2020 a été accompagnée <b>d’une vague\r\nde désinformation planétaire</b>. Une désinformation qui passe majoritairement\r\npar les réseaux sociaux (Facebook, Groupe WhatsApp, Twitter, etc.)</span></p>\r\n\r\n<p class=\"MsoBodyText\" style=\"text-align:justify;text-justify:inter-ideograph\"><b><span style=\"mso-bidi-font-size:18.0pt;font-family:Montserrat\">Que savons-nous\r\naujourd’hui de cette masse de désinformation&nbsp;?</span></b><span style=\"mso-bidi-font-size:18.0pt;font-family:Montserrat;mso-bidi-font-weight:\r\nbold\"> </span></p>\r\n\r\n<b><span style=\"font-size:11.0pt;mso-bidi-font-size:18.0pt;font-family:Montserrat;\r\nmso-fareast-font-family:Carlito;mso-bidi-font-family:Carlito;mso-ansi-language:\r\nFR;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">Que devons-nous faire\r\nafin de réduire cette vague de désinformation&nbsp;? </span></b></p><p><b><span style=\"font-size:11.0pt;mso-bidi-font-size:18.0pt;font-family:Montserrat;\r\nmso-fareast-font-family:Carlito;mso-bidi-font-family:Carlito;mso-ansi-language:\r\nFR;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\"><br></span></b></p><p><span style=\"font-size:11.0pt;mso-bidi-font-size:18.0pt;font-family:Montserrat;\r\nmso-fareast-font-family:Carlito;mso-bidi-font-family:Carlito;mso-ansi-language:\r\nFR;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">C\'est dans</span><span style=\"font-size:11.0pt;mso-bidi-font-size:18.0pt;font-family:Montserrat;\r\nmso-fareast-font-family:Carlito;mso-bidi-font-family:Carlito;mso-ansi-language:\r\nFR;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\"> ce cadre que l\'ONG SIA N\'SONG a initié une séance de sensibilisation sur la vaccination contre&nbsp; COVID-19 et le fact - Checking&nbsp; à l\'endroit des administrateurs de groupes WhatsApp dans les communes de Djougou et Bassila.</span><b><span style=\"font-size:11.0pt;mso-bidi-font-size:18.0pt;font-family:Montserrat;\r\nmso-fareast-font-family:Carlito;mso-bidi-font-family:Carlito;mso-ansi-language:\r\nFR;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\"><br></span></b><p><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>FR</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w:CachedColBalance/>\r\n   <w:UseFELayout/>\r\n  </w:Compatibility>\r\n  <w:DoNotOptimizeForBrowser/>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"/>\r\n   <m:brkBin m:val=\"before\"/>\r\n   <m:brkBinSub m:val=\"&#45;-\"/>\r\n   <m:smallFrac m:val=\"off\"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val=\"0\"/>\r\n   <m:rMargin m:val=\"0\"/>\r\n   <m:defJc m:val=\"centerGroup\"/>\r\n   <m:wrapIndent m:val=\"1440\"/>\r\n   <m:intLim m:val=\"subSu