Exception Locked=\"false\" Priority=\"65\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" Name=\"Medium List 1 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"66\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" Name=\"Medium List 2 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"67\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" Name=\"Medium Grid 1 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"68\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" Name=\"Medium Grid 2 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"69\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" Name=\"Medium Grid 3 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"70\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" Name=\"Dark List Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"71\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" Name=\"Colorful Shading Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"72\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" Name=\"Colorful List Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"73\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" Name=\"Colorful Grid Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"19\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Emphasis\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"21\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Emphasis\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"31\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Reference\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"32\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Reference\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"33\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Book Title\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Tableau Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:\"Times New Roman\",\"serif\";}\r\n</style>\r\n<![endif]--></p><p>Pendant toute la journée du 14 Décembre 2021, les administrateurs des réseaux sociaux résident dans la ville de Djougou et ses environs ont eu droit à des panels de communication sur la vaccination contre la COVID-19, Cette communication a aussi porté sur les attitudes à avoir face aux rumeurs qui circulent à propos de la vaccination contre la COVID-19, ses avantages, les types de vaccins disponibles et nombre de doses, le fondement de la fiche de consentement et le mécanisme de compensation en cas d\'effet secondaire. La&nbsp; vérification de la véracité des informations qui circulent sur ces réseaux sociaux était également à l\'ordre du jour. Ils étaient une trentaine d\'administrateurs des réseaux sociaux à participer à cet atelier qui a eu lieu dans les locaux de de SIA N\'SONG- Djougou. </p><p><br>En effet, après l\'étape de Djougou, les administrations des réseaux sociaux de la ville de Bassila ont également eu droit à ces mêmes Panels dans la journée du 15 Décembre 2021 dernier. Une vingtaine d\'administrateurs de réseaux sociaux ont répondu présent à cette séance de communication qui a eu lieu dans la salle numérique du CEG 1 Bassila.</p><p>C\'est grâce à l\'expertise de Mr Wilfried ETEKA, fondateur de Odacesoft que ces administrateurs de réseaux sociaux ont eu droit aux outils nécessaires afin d\'identifier et de bannir les fake news de leurs différents réseaux en cette période de propagation de fausses nouvelle.<br></p><p><br>Le souhait des initiateurs de ce projets est d\'aider les administrateurs des groupes WhatsApp, Facebook et autres à mieux comprendre les enjeux de la vaccination et à disposer des outils nécessaires afin de mieux se défendre face aux rumeurs qui circulent dans leurs groupes respectifs.<br></p></p>', 1, './storage/disk/activites/formation-_560648.jpeg', 66, 1, 1, '2021-12-19 09:09:00', '2022-12-12 15:40:42', NULL);
INSERT INTO `activites` (`id`, `title`, `slug`, `statut`, `lead`, `content`, `temps`, `img`, `view_count`, `user_id`, `actif`, `created_at`, `updated_at`, `deleted_at`) VALUES
(11, 'Promotion du numérique à Parakou, l\'agence d\'ingénierie en informatique \"Odacesoft\" s\'installe à Zongo', 'promotion-du-numerique-a-parakou-lagence-dingenierie-en-informatique-odacesoft-sinstalle-a-zongo', '-', 'Le lundi 17 Janvier à 10 heures s\'est déroulée la cérémonie d\'ouverture des nouveaux locaux de Odacesoft sise au quartier Zongo 2 à Parakou. Ils étaient une trentaine de participants à prendre part à cet événement.', '<div class=\"\" dir=\"auto\"><div class=\"ecm0bbzt hv4rvrfc ihqw7lf3 dati1w0a\" data-ad-comet-preview=\"message\" data-ad-preview=\"message\" id=\"jsc_c_ew\"><div class=\"j83agx80 cbu4d94t ew0dbk1b irj2b8pg\"><div class=\"qzhwtbm6 knvmm38d\"><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j fe6kdd0r mau55g9w c8b282yb keod5gw0 nxhoafnm aigsh9s9 d3f4x2em iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><b>Un cadre idéal de création et d\'innovation pour les jeunes entrepreneurs du numérique</b></div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">L\'agence d\'ingénierie en informatique \"Odacesoft\"  est résolument engagée à apporter significativement sa touche pour la promotion du numérique dans la ville de Parakou. Ainsi, elle a décidé de la création d\'un nouveau siège au quartier Zongo, dans le troisième arrondissement de la ville de Parakou et de ses environs afin de mieux servir les jeunes entrepreneurs dans ce domaine de grande portée. La cérémonie symbolique d\'inauguration de ce nouveau siège s\'est déroulée le mardi 18 janvier 2022 en présence du directeur de l\'Odacesoft Wilfried Etèka, des jeunes entrepreneurs et chefs d\'entreprise du numérique de la cité des Koburu.<b><br></b><br></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Installée à Zongo-2 dans le troisième arrondissement de Parakou, plus précisément au niveau de la première rue à droite avant l\'ex classico en quittant le marché Zongo, l\'agence d\'ingénierie en informatique \"odacesoft\" est spécialisée dans le domaine du numérique notamment de la Technologie de l\'Information et de la Communication (Tic). Ainsi, elle offre plusieurs services du numérique à la communauté dont entre autres, le développement d\'applications ; l\'expertise et formation ainsi que la communication digitale.</div><div dir=\"auto\" style=\"text-align: start;\"><br></div></div></div></span><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j fe6kdd0r mau55g9w c8b282yb keod5gw0 nxhoafnm aigsh9s9 d3f4x2em iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Don intervention, le directeur Wilfried Etèka a fait savoir que l\'odacesoft est une agence qui offre un gamme de services aux jeunes entrepreneurs qui excellent dans les domaines du numérique. « Dans le domaine de l\'accompagnement des jeunes aux métiers du numérique, nous avons un projet dénommé \"memory to statup\" qui est destiné aux jeunes entrepreneurs principalement des étudiants qui sont en fin de formation et qui souhaitent s\'essayer dans l\'entrepreneuriat numérique », a-t-il précisé avant d\'ajouter que, « nous les accompagnons à concrétiser leur rêve. Nous avons fait l\'expérience l\'année dernière et nous sommes à la deuxième édition. Le concours est déjà lancé et les candidats s\'inscrivent déjà. Nous allons démarrer l\'incubation en février prochain ».</div><div dir=\"auto\" style=\"text-align: start;\"><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"odacesoft-_562240.jpg\"><br></div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j fe6kdd0r mau55g9w c8b282yb keod5gw0 nxhoafnm aigsh9s9 d3f4x2em iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><br></div></div></span><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j fe6kdd0r mau55g9w c8b282yb keod5gw0 nxhoafnm aigsh9s9 d3f4x2em iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" align=\"center\"><b>[Photo de famille après la cérémonie d\'ouverture]</b></div><div dir=\"auto\" align=\"center\"><b><br></b></div></div></span></div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Ainsi, l\'agence d\'ingénierie en informatique \"Odacesoft\" est un cadre idéal de création et d\'innovation pour les jeunes qui entreprennent dans les domaines du numérique qui leur permettra, sans doute, de s\'exceller dans ce secteur d\'activités de l\'avenir. Alors, c\'est une opportunité à saisir absolument. </div><div dir=\"auto\" style=\"text-align: start;\"><br></div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><b>Source: </b>Journal L\'Etudiant Noir, la plume au service de la communauté</div></div></span></div></div></div></div>', 2, './storage/disk/activites/promotion-_437112.jpg', 123, 1, 1, '2022-01-20 07:35:29', '2022-12-01 08:02:20', NULL);
INSERT INTO `activites` (`id`, `title`, `slug`, `statut`, `lead`, `content`, `temps`, `img`, `view_count`, `user_id`, `actif`, `created_at`, `updated_at`, `deleted_at`) VALUES
(12, 'Odacesoft, l\'agence d\'ingénierie en informatique ouvre les portes de ses nouveaux locaux à Zongo', 'odacesoft-lagence-dingenierie-en-informatique-ouvre-les-portes-de-ses-nouveaux-locaux-a-zongo', '-', 'L\'agence d\'ingénierie en informatique, odacesoft ouvre les portes de ses nouveaux locaux à Zongo-2 après avoir déménagé du quartier Gbira.', '<div class=\"\" dir=\"auto\"><div class=\"ecm0bbzt hv4rvrfc ihqw7lf3 dati1w0a\" data-ad-comet-preview=\"message\" data-ad-preview=\"message\" id=\"jsc_c_1h\"><div class=\"j83agx80 cbu4d94t ew0dbk1b irj2b8pg\"><div class=\"qzhwtbm6 knvmm38d\"><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j fe6kdd0r mau55g9w c8b282yb keod5gw0 nxhoafnm aigsh9s9 d3f4x2em iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">La cérémonie d\'inauguration a eu lieu ce mardi 18 janvier 2022, au siège de l\'agence située dans à Zongo-2 dans le troisième arrondissement de Parakou, plus précisément au niveau de la première rue à droite avant l\'ex classico en quittant le marché Zongo. </div><div dir=\"auto\" style=\"text-align: start;\"><br></div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Cette agence est spécialisée dans le domaine du numérique notamment dans la Technologie de l\'Information et de la Communication (Tic). Elle offre plusieurs services aux populations de la cité des Kobourou et ses environs. Il s\'agit entre autres, des sévices en développement d\'applications ; d\'expertise et formation ; communication digitale et bien d\'autres. </div><div dir=\"auto\" style=\"text-align: start;\"><br></div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Pour le directeur de odacesoft, Wilfried Etèka, outre les services offerts aux populations, son agence forme les jeunes en général et les femmes en particulier dans les métiers du numérique. <b>« Dans le domaine de l\'accompagnement des jeunes aux métiers du numérique, nous avons un projet dénommé \"memory to statup\" qui est destiné aux jeunes entrepreneurs principalement des étudiants qui sont en fin de formation et qui souhaitent s\'essayer dans l\'entrepreneuriat numérique. Nous les accompagnons à concrétiser leur rêve.</b></div><div dir=\"auto\" style=\"text-align: start;\"><b>Nous avons fait l\'expérience l\'année dernière et nous sommes à la deuxième édition. Le concours est déjà lancé et les candidats s\'inscrivent déjà. Nous allons démarrer l\'incubation en février prochain »</b>, a précisé Wilfried Etèka. </div><div dir=\"auto\" style=\"text-align: start;\"><br></div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Il faut souligner que la cérémonie d\'inauguration de l\'agence s\'est déroulée en présence des jeunes entrepreneurs et chefs d\'entreprise dans le domaine du numérique à Parakou. Pour plus d\'informations sur les offres de services de l\'agence, contactez le +229 64 84 42 12 .</div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><br></div><div dir=\"auto\" style=\"text-align: start;\"><b>Source:</b> Rédaction Journal Akôwé <span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"✍️\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t69/1.5/16/270d.png\" width=\"16\" height=\"16\"></span></div></div></span></div></div></div></div>', 2, './storage/disk/activites/odacesoft-_562240.jpg', 153, 1, 1, '2022-01-20 21:20:57', '2022-12-01 08:02:20', NULL),
(13, 'Participation de Odacesoft aux activités de formation des responsables de programmes et les chargés d\'accompagnement organisées par Afric’Innov', 'participation-de-odacesoft-aux-activites-de-formation-des-responsables-de-programmes-et-les-charges-daccompagnement-organisees-par-africinnov', '-', 'A travers le programme DIGIBOOST, Odacesoft bénéficie depuis l’année 2021 d’une série de formations afin d’améliorer son programme d’accompagnement dénommé Mmeory2Stratup.', '<p>\n\n</p>Les jeunes entreprises représentent une véritable aubaine\npour la structuration et le fonctionnement d’un modèle de développement durable\nde nos pays. L’enjeu national du développement passe par la création et\nl’accompagnement d’entreprises innovantes. L’émergence de structures <span style=\"mso-spacerun:yes\">&nbsp;</span>l’accompagnement telles que Odacesoft est un\nfacteur essentiel dans l’amélioration de la performance des entreprises béninoises.\nToutefois, l’accompagnement d’entreprises et d’entrepreneurs demeure un domaine\nscientifique et technique assez récent en Afrique. Ce manque de compétences\nconstitue un véritable défi pour les SAEI.\n\n<p><br></p><p class=\"MsoNormal\">Le programme de formation et de renforcement des capacités\ndes SAEI béninoises initiée conjointement par Enabel à travers le programme Digiboost\net exécuté par Afric’innov,<span style=\"mso-spacerun:yes\">&nbsp; </span>est une\nsolution à l’amélioration du fonctionnement des SAEI et des capacités de\ncelles-ci à fournir des cadres efficaces pour le développement des jeunes\nentreprises. </p>\n\n<p>C’est ainsi que du 10 au 14 Janvier dernier s’est tenue à\nGranp-Popo, une formation destinée aux responsables de programmes et les\nchargés d\'accompagnement. Cette formation a été organisée Afric’Innov et a\nporté sur les thématiques suivantes&nbsp;:</p><ul><li><b>Comment identifier, attirer et intégrer des\nentrepreneurs dans sa SAEI&nbsp;?</b></li><li><span style=\"mso-ascii-font-family:Calibri;mso-fareast-font-family:Calibri;\nmso-hansi-font-family:Calibri;mso-bidi-font-family:Calibri;mso-bidi-font-weight:\nbold\"><span style=\"mso-list:Ignore\"><span style=\"font:7.0pt &quot;Times New Roman&quot;\"></span></span></span><b>Comment Structurer un programme\nd’accompagnement&nbsp;?</b></li><li><b>Comment Gérer l\'exécution d\'un programme\nd\'accompagnement ?<br></b></li></ul>\n\n<p class=\"MsoNormal\">Les acquis de cette formation permettront à coup sûr de\nréorienter les programmes <span style=\"mso-spacerun:yes\">&nbsp;</span>d’accompagnement\nde Odacesoft et de fournir des services de qualité à la hauteur des attentes\ndes porteurs de projets.</p>\n\n<!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves/>\n  <w:TrackFormatting/>\n  <w:HyphenationZone>21</w:HyphenationZone>\n  <w:PunctuationKerning/>\n  <w:ValidateAgainstSchemas/>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF/>\n  <w:LidThemeOther>FR</w:LidThemeOther>\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables/>\n   <w:SnapToGridInCell/>\n   <w:WrapTextWithPunct/>\n   <w:UseAsianBreakRules/>\n   <w:DontGrowAutofit/>\n   <w:SplitPgBreakAndParaMark/>\n   <w:DontVertAlignCellWithSp/>\n   <w:DontBreakConstrainedForcedTables/>\n   <w:DontVertAlignInTxbx/>\n   <w:Word11KerningPairs/>\n   <w:CachedColBalance/>\n  </w:Compatibility>\n  <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>\n  <m:mathPr>\n   <m:mathFont m:val=\"Cambria Math\"/>\n   <m:brkBin m:val=\"before\"/>\n   <m:brkBinSub m:val=\"&#45;-\"/>\n   <m:smallFrac m:val=\"off\"/>\n   <m:dispDef/>\n   <m:lMargin m:val=\"0\"/>\n   <m:rMargin m:val=\"0\"/>\n   <m:defJc m:val=\"centerGroup\"/>\n   <m:wrapIndent m:val=\"1440\"/>\n   <m:intLim m:val=\