INSERT INTO `activites` (`id`, `title`, `slug`, `statut`, `lead`, `content`, `temps`, `img`, `view_count`, `user_id`, `actif`, `created_at`, `updated_at`, `deleted_at`) VALUES
(14, 'Participation à l\'atelier des restructuration de la Fédération des Structures d’Accompagnement à l’Entreprenariat Innovant du Bénin', 'participation-a-latelier-des-restructuration-de-la-federation-des-structures-daccompagnement-a-lentreprenariat-innovant-du-benin', '-', 'Du Mercredi 2 au Vendredi 4 Février 2022 a eu lieu dans les locaux de « Hôtel des Princes » un atelier portant sur la Restructuration de la Fédération des Structures d’Accompagnement à l’Entreprenariat Innovant (SAEI) du Bénin', '<p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\">Durant trois (03) jours, les Structures d’Accompagnement à l’Entreprenariat Innovant (SAEI) du Bénin se sont réunis à Bohicon dans le cadre du proet DigiBoost, afin la mise en place d\'une équipe qui désormais conduira toutes les activités de l\'écosystème.&nbsp;Les premières journées ont été consacrées à la rédaction des textes de la fédération notamment\nsur la vision, la mission les objectifs, les valeurs et les règlements de la fédération à\nmettre en place. Les travaux de groupes ont permis d\'aboutir à&nbsp; la\nrédaction de ces statuts qui sont basés des normes existantes. </span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\"><br></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\">Cette Fédération ste constituée d’un Conseil d’Administration (composé de 7 membres),\nd’un Conseil se surveillance (constitué de 3 commissaires au compte) et d’une\nDirection exécutive (constituée au moins d’un Directeur Exécutif et d’un\ncomptable).&nbsp; <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-family: Montserrat; font-size: 12pt;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><font face=\"Montserrat\">Un aspect particulier a été mis sur les types de membres au niveau de la fédération : membres, membre actifs, membres sympathisants. Les membres actifs sont en réalité des membres à jour vis-à-vis des cotisations de la Fédération qui se présentent comme suie :</font><br></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0cm;margin-right:0cm;\nmargin-bottom:10.0pt;margin-left:36.0pt;mso-add-space:auto;text-align:justify;\ntext-indent:-18.0pt;line-height:115%;mso-pagination:widow-orphan;mso-list:l0 level1 lfo1;\ntext-autospace:ideograph-numeric ideograph-other\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:115%;\nfont-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:Calibri\">-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-size:12.0pt;\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:Montserrat\">Frais d’adhésion&nbsp;:\n30.000F</span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0cm;margin-right:0cm;\nmargin-bottom:10.0pt;margin-left:36.0pt;mso-add-space:auto;text-align:justify;\ntext-indent:-18.0pt;line-height:115%;mso-pagination:widow-orphan;mso-list:l0 level1 lfo1;\ntext-autospace:ideograph-numeric ideograph-other\"><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 12pt; line-height: 115%; font-family: Calibri, &quot;sans-serif&quot;;\">-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span></span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 12pt; line-height: 115%; font-family: Montserrat;\">Frais annuel\nde participation&nbsp;: 60.000F (soit 5.000F par mois)</span></p><ol><li style=\"text-align: left;\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\">Il était\naussi question de la procédure de remplacement des membres du conseil d’administration,\ndes sanctions à l’encontre des membres de la fédération en cas de manquement ou\nde désobéissance aux règles établies. </span></li></ol><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\"><br></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\">Il a été procédé à l’élection des membres du Conseil d’Administration et du\nConseil de Suivi. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;mso-outline-level:1\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;\nmso-bidi-font-size:11.0pt;font-family:Montserrat\">Le Bureau du conseil d’administration se présente comme suit :<o:p></o:p></span></b></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0cm;margin-right:0cm;\nmargin-bottom:10.0pt;margin-left:36.0pt;mso-add-space:auto;text-align:justify;\ntext-indent:-18.0pt;line-height:115%;mso-pagination:widow-orphan;mso-list:l0 level1 lfo1;\ntext-autospace:ideograph-numeric ideograph-other\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:115%;\nfont-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:Calibri\">-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-size:12.0pt;\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:Montserrat\">Président&nbsp;:\nBloLab &nbsp;(Porto)<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\nmargin-bottom:10.0pt;margin-left:36.0pt;mso-add-space:auto;text-align:justify;\ntext-indent:-18.0pt;line-height:115%;mso-pagination:widow-orphan;mso-list:l0 level1 lfo1;\ntext-autospace:ideograph-numeric ideograph-other\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:115%;\nfont-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:Calibri\">-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-size:12.0pt;\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:Montserrat\">Vice-Président&nbsp;:\nTIC-Agro Business &nbsp;(Natitingou)<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\nmargin-bottom:10.0pt;margin-left:36.0pt;mso-add-space:auto;text-align:justify;\ntext-indent:-18.0pt;line-height:115%;mso-pagination:widow-orphan;mso-list:l0 level1 lfo1;\ntext-autospace:ideograph-numeric ideograph-other\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:115%;\nfont-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:Calibri\">-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-size:12.0pt;\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:Montserrat\">Secrétaire\nGénéral&nbsp;: EtriLabs (Cotonou)<o:p></o