"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-size:12.0pt;\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:Montserrat\">Commissaire\nau compte N°3&nbsp;: C&amp;G Consulting (Cotonou)</span></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0cm;margin-right:0cm;\nmargin-bottom:10.0pt;margin-left:36.0pt;mso-add-space:auto;text-align:justify;\ntext-indent:-18.0pt;line-height:115%;mso-pagination:widow-orphan;mso-list:l0 level1 lfo1;\ntext-autospace:ideograph-numeric ideograph-other\"><br></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin: 0cm 0cm 10pt 23px; text-align: justify; text-indent: -18pt; line-height: 115%;\"><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"FormatFactoryIMG_3577~1.jpg\"></p><p class=\"MsoNormal\" style=\"text-align: center;\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\"><b>[Photo de famille du Conseil d\'Administration et du Conseil Consultatif des SAEI du Bénin]</b></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\"><br></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\">Le conseil d\'administration ainsi mis en place a procédé une proposition d\'un Plan d’action pour la\nl\'année en cours qui a été amélioré par des suggestions et contributions des participants. </span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\">Plusieurs\nactivités sont prévues dans ce PTA au profit des SAEI membre de la fédération\nen termes de renforcement de capacité, de mobilisation de ressources, de\nsynergie d’action, etc.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\">C\'était l\'occasion pour la Coordonatrice du projet DigiBoost de féliciter tous les participants pour avoir privilégié l’intérêt du groupe au détriment de l’intérêt personnel.&nbsp;&nbsp;</span><span style=\"font-family: Montserrat; font-size: 12pt;\">Elle a promis être aux côtés des SAEI afin d\'assainir l\'écosystème des SAEI en République du Bénin.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<!--[endif]--><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:\n11.0pt;line-height:115%;font-family:Montserrat\"><o:p></o:p></span>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n</p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\">L’atelier\nde travail a pris fin aux environs de quinze heures avec une photo de famille à\nla satisfaction de tous les participants.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\"><br></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\">Découvrez les photos de cet atelier à travers ce lien:&nbsp;</span><span style=\"color: var(--blue-link); font-family: inherit; font-size: 15px; white-space: pre-wrap;\"><a href=\"https://flic.kr/s/aHBqjzBQij\" target=\"_blank\">https://flic.kr/s/aHBqjzBQij</a></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\"><o:p></o:p></span></p>', 2, './storage/disk/activites/participat_726676.jpg', 103, 1, 1, '2022-02-06 13:17:07', '2022-12-12 09:19:40', NULL);
INSERT INTO `activites` (`id`, `title`, `slug`, `statut`, `lead`, `content`, `temps`, `img`, `view_count`, `user_id`, `actif`, `created_at`, `updated_at`, `deleted_at`) VALUES
(15, 'Atelier de formation sur les procédures de levée de fonds, les services d’accélération et la mise en place d’un espace de Coworking', 'atelier-de-formation-sur-les-procedures-de-levee-de-fonds-les-services-dacceleration-et-la-mise-en-place-dun-espace-de-coworking', '-', 'Nous avons participé à un Atelier de formation à Grand-Popo, du 24 au 27 Janvier 2022 sur le renforcement des capacités de l\'équipe technique  de notre structure d\'accompagnement', '<p class=\"MsoNormal\" style=\"text-align:justify\">Le développement des jeunes\nentreprises est une étape primordiale dans la croissance durable des structures\nd’accompagnement à entreprenariat Innovant (SAEI). Après s’être lancé et\nréalisé des résultats intéressant, la plupart des entreprises ont besoin d’un coup\nde main en matière de financement mais également en matière d’organisation du\nfonctionnement interne.</p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify\"> </p><p class=\"MsoNormal\" style=\"text-align:justify\">Le lancement des activités est un\nindicateur de base de la bonne marche de toute entreprise qui souhaite grandir.\nLes SAEI, à travers les espaces de travail partagé (espace de coworking)\npermettent aux jeunes entrepreneurs de s’organiser et de démarrer leurs projets\ndans de meilleurs conditions.</p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify\"><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"271663675_309131747910613_6306207989611270690_n.jpg\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify\"> </p><p class=\"MsoNormal\" style=\"text-align: center;\"><b><i>[Photo de famille des participants]</i></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify\">Etant donné que Odacesoft dispose\nd’un programme d’accompagnement à l’entreprenariat Innovant, il nous revient de\nfournir les meilleurs outils de travail aux incubés et entrepreneurs. Cela\nconstitue une garantie de productivité et de performance des entreprises\naccompagnées. C’est justement en ce sens qu’à eu lieu à Grand-Popo du 24 au 27\nJanvier 2022, un atelier de renforcement de capacité sur les services\nd’accélération et de levée de fonds conjointement. Cet atelier est initié par\nle proejt Digiboost, finacé par Enabel et assuré de main de maître par Afric’innov.\nDeux membres de l’équipe de Odacesoft ont participé à cet atelier . Il s’agit\nde&nbsp;:</p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><p class=\"MsoListParagraphCxSpFirst\" style=\"text-align: justify; text-indent: -18pt; margin-left: 25px;\"><!--[if !supportLists]-->-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span><!--[endif]-->Ludovic BEKOU (Chargé des Programme &amp;\nResponsable qualité) et </p><p class=\"MsoListParagraphCxSpLast\" style=\"text-align: justify; text-indent: -18pt; margin-left: 25px;\"><!--[if !supportLists]-->-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span><!--[endif]-->EKPALIGUIDIME Michaël Mélias (Assistant du\nResponsable de l’Incubation)</p><p class=\"MsoListParagraphCxSpLast\" style=\"text-align: justify; text-indent: -18pt; margin-left: 25px;\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify\">Cet atelier est le deuxième du\nprogramme de formation des responsables des SAEI béninoises. Durant 3 jours de\nformations, à la salle de conférence de l’Hôtel Ganna de Grand-Popo, les\néquipes des SAEI du Bénin ont été formés sur les procédures de levée de fonds,\nles services d’accélération et la mise en place d’un espace de Coworking. Les\nateliers ont été conduits par deux principaux intervenants ayant des\nexpériences accrues dans le secteur financier comme dans l’accélération\nd’entreprises. Dans une ambiance décontractée et surtout magistral, la cohorte\nde la cinquantaine d’acteurs de l’accompagnement entrepreneurial au Bénin ont\nété entretenus sur les procédures de mobilisation de capitaux pour les jeunes\nentreprises ; et également sur l’amélioration des services d’accélération\nproposés par les SAEI.</p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify\">Les principales compétences\nacquises après l’atelier sont énumérées ci-après : </p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><span style=\"font-family:Symbol;mso-ascii-font-family:Calibri;\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\nminor-latin;mso-char-type:symbol;mso-symbol-font-family:Symbol\">·</span> Les\ndifférentes formes de mobilisation de fonds et capitaux ; </p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><span style=\"font-family:Symbol;mso-ascii-font-family:Calibri;\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\nminor-latin;mso-char-type:symbol;mso-symbol-font-family:Symbol\">·</span> Les\ndocuments essentiels dans un dossier de demande de financement ; </p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><span style=\"font-family:Symbol;mso-ascii-font-family:Calibri;\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\nminor-latin;mso-char-type:symbol;mso-symbol-font-family:Symbol\">·</span> La\ntenue d’une comptabilité efficiente ; </p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><span style=\"font-family:Symbol;mso-ascii-font-family:Calibri;\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\nminor-latin;mso-char-type:symbol;mso-symbol-font-family:Symbol\">·</span> Les\nstructures finançant des entreprises africaines ; </p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><span style=\"font-family:Symbol;mso-ascii-font-family:Calibri;\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\nminor-latin;mso-char-type:symbol;mso-symbol-font-family:Symbol\">·</span> Les\néléments essentiels dans la construction d’un espace de coworking optimal ; </p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><span style=\"font-family:Symbol;mso-ascii-font-family:Calibri;\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\nminor-latin;mso-char-type:symbol;mso-symbol-font-family:Symbol\">·</span> La\ntarification d’un espace de coworking ; </p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><span style=\"font-family:Symbol;mso-ascii-font-family:Calibri;\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\nminor-latin;mso-char-type:symbol;mso-symbol-font-family:Symbol\">·</span>\nProposer des services pour rentabiliser une SAEI.</p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"272529382_4684721578242196_7475875376925265431_n.jpg\"><br></p><p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n</p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><o:p>&nbsp;</o:p></p>', 3, './storage/disk/activites/atelier-de_725668.jpg', 65, 1, 1, '2022-02-12 23:57:27', '2022-11-29 22:33:04', NULL);
INSERT INTO `activites` (`id`, `title`, `slug`, `statut`, `lead`, `content`, `temps`, `img`, `view_count`, `user_id`, `actif`, `created_at`, `updated_at`, `deleted_at`) VALUES
(16, 'Deuxième cohorte du programme d\'incubation Memory2Startup, la liste des projets sélectionnés disponible', 'deuxieme-cohorte-du-programme-dincubation-memory2startup-la-liste-des-projets-selectionnes-disponible', '-', 'Odacesoft à travers son programme d\'incubation a lancé un appel à projet pour la sélection des projets d\'entreprises. La liste des lauréats de la deuième cohorte est enfin disponible.', '<div dir=\"auto\"><font color=\"#050505\"><span style=\" white-space: pre-wrap;\">L’accompagnement des jeunes entrepreuneurs a pour objectif d’analyser d\'être aux cotés des porteurs de projets afin les rendre performant et viable. Il s\'agit entre autre d\'éliminer un maximum d\'incertitudes sur le modèle économique afin de dé-risquer le plus possible les projets entrepreneuriaux.\n\nLa finalité de l’incubation est bien entendu la commercialisation avec succès des projets innovants, l’atteinte de l‘indépendance financière des startup et enfin, l’industrialisation du produit ou service innovant (scalabilité). \n\nC\'est dans cette dynamique que Odacesoft s\'est lancé depuis l\'année dernière dans l\'Incubation de projets innovants avec pour objectif  </span><span style=\" white-space: pre-wrap; font-weight: bolder;\">\"Accompagner les jeunes diplômés à mettre en place des entreprises viables à fort impact au Bénin\".</span><span style=\" white-space: pre-wrap;\">\n\nAprès plus de deux mois d\'appel à projet, voici la liste des projets retenus  pour la phase d\'incubation :\n</span><span style=\" white-space: pre-wrap; font-weight: bolder;\">1- AGROBIOTOS : </span><span style=\" white-space: pre-wrap;\">Plateforme de formation, d\'accompagnement a l\'installation , appuis conseils et de suivi des fermes. \n</span><span style=\" white-space: pre-wrap; font-weight: bolder;\">2- SEDEWU : </span><span style=\" white-space: pre-wrap;\">Transformation et commercialisation de la tomate, du piment et de l\'ail en purée ou concentrée bio.\n</span><span style=\" white-space: pre-wrap; font-weight: bolder;\">3- TIME KING :</span><span style=\" white-space: pre-wrap;\"> Système de gestion de présence au poste. \n</span><span style=\" white-space: pre-wrap; font-weight: bolder;\">4- FEEL GOOD : </span><span style=\" white-space: pre-wrap;\">Production et commercialisation de produits laitiers.\n</span><span style=\" white-space: pre-wrap; font-weight: bolder;\">5- Scanner 3D : </span><span style=\" white-space: pre-wrap;\">Conception et réalisation d\'un scanneur électronique pour l\'acquisition de forme 3D\n</span><span style=\" white-space: pre-wrap; font-weight: bolder;\">6- Bénin E-ticket :</span><span style=\" white-space: pre-wrap;\"> Plateforme de Réservation de Tickets de voyage.\n</span><span style=\" white-space: pre-wrap; font-weight: bolder;\">7- INO AGENCY : </span><span style=\" white-space: pre-wrap;\">Mise en place portail numérique touristique et d\'un musé virtuel en 2D/3D\n\nC\'est le moment de remercier toute l\'équipe du comité de sélection et de ceux qui d\'une manière ou d\'une autre contribue à l\'accompagnement de nos initiatives. Nous disons félicitations aux lauréats et les exhortons à se rendre disponible pour les prochaines étapes du processus d\'incubation.</span></font><span style=\"color: rgb(5, 5, 5); font-family: inherit;  white-space: pre-wrap;\">\n</span></div><div><br></div>', 2, './storage/disk/activites/deuxieme-c_504332.jpg', 45, 1, 1, '2022-02-16 23:00:34', '2022-10-13 07:59:43', NULL),
(17, 'Odacesoft lance le recrutement de stagiaires dans trois domaines : Secrétariat, Design et Communication et développement d\'applications', 'odacesoft-lance-le-recrutement-de-stagiaires-dans-trois-domaines-secretariat-design-et-communication-et-developpement-dapplications', '-', 'Afin d\'aider les jeunes à trouver un meilleur environnement de développement de leur talent, odacesoft lance la première vague de recrutement de stagiaires', '<div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">LES DEMANDES DE STAGES SONT OUVERTES À ODACESOFT </div><div dir=\"auto\" style=\"font-family: inherit;\">Vous avez longtemps demandé, nous réagissons favorablement à votre demande en vous ouvrant les portes.</div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">Rejoignez-nous si vous souhaitez développer vos talents dans les différents domaines suivants :</div><div dir=\"auto\" style=\"font-family: inherit;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\" style=\"margin: 0px 1px; height: 16px; width: 16px; display: inline-flex; vertical-align: middle; font-family: inherit;\"><img height=\"16\" width=\"16\" alt=\"✅\" referrerpolicy=\"origin-when-cross-origin\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" style=\"border-style: initial; border-color: initial;\"></span> SECRÉTARIAT</div><div dir=\"auto\" style=\"font-family: inherit;\"><sp