(18, 'NOUS RECRUTONS UNE SECRÉTAIRE QUALIFIÉE', 'nous-recrutons-une-secretaire-qualifiee', '-', 'Afin d\'assurer la gestion du secrétariat de notre structure, nous recherchons une secrétaire qualifiée résidant à Parakou et disponible à rejoindre une aventure impactante', '<div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px; white-space: pre-wrap;\"><br></div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px; white-space: pre-wrap;\">Vous une femme, vous résidez à Parakou et souhaitez rejoindre l\'aventure <span style=\"font-family: inherit;\"><a class=\"oajrlxb2 g5ia77u1 qu0x051f esr5mh6w e9989ue4 r7d6kgcz rq0escxv nhd2j8a9 nc684nl6 p7hjln8o kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x jb3vyjys rz4wbd8a qt6c0cv9 a8nywdso i1ao9s8h esuyzwwr f1sip0of lzcic4wl gpro0wi8 q66pz984 b1v8xokw\" href=\"https://web.facebook.com/hashtag/odacesoft?__eep__=6&amp;__cft__[0]=AZWX1A7F_G8Ez1brEz851M-r9OQ4sdgl-3oIHiEdkpSCxgnDIKM7AKly-lfcga0zaBNIHmrZnYxAKw6GRja3uRTesTcF77DhyGXNOPxzgn85hsr__k6CAY_FrOUvDe8C4QWKBSSSO9Bem4r4R9j2qvbanvzwVmFZJMOnO9FKUkfAOcbVL7xFhhcEJm-TBA-opHY&amp;__tn__=*NK-R\" role=\"link\" tabindex=\"0\" style=\"color: var(--accent); cursor: pointer; list-style: none; border-style: initial; border-color: initial; padding: 0px; margin: 0px; touch-action: manipulation; background-color: transparent; text-align: inherit; display: inline; -webkit-tap-highlight-color: transparent; font-family: inherit;\">#Odacesoft</a></span>, cette annonce peut vous intéresser. </div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px; white-space: pre-wrap;\">Conditions à remplir :</div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helveti