n.net/images/emoji.php/v9/tba/1.5/16/2705.png\" style=\"border-style: initial; border-color: initial;\"></span> Curriculum vitæ (CV) </div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px; white-space: pre-wrap;\">Comment postuler ? </div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px; white-space: pre-wrap;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\" style=\"margin: 0px 1px; height: 16px; width: 16px; display: inline-flex; vertical-align: middle; font-family: inherit;\"><img height=\"16\" width=\"16\" alt=\"✅\" referrerpolicy=\"origin-when-cross-origin\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tba/1.5/16/2705.png\" style=\"border-style: initial; border-color: initial;\"></span> Les candidatures sont reçues jusqu\'au lundi 7 Mars à 18Heures à l\'adresse email odacesoft@gmail.com </div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px; white-space: pre-wrap;\"><br></div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px; white-space: pre-wrap;\">Odacesoft, pour créer des possibilités ! <span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\" style=\"margin: 0px 1px; height: 16px; width: 16px; display: inline-flex; vertical-align: middle; font-family: inherit;\"><img height=\"16\" width=\"16\" alt=\"❤️\" referrerpolicy=\"origin-when-cross-origin\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tf3/1.5/16/2764.png\" style=\"border-style: initial; border-color: initial;\"></span> </div><br>', 1, './storage/disk/activites/nous-recru_347402.jpg', 19, 1, 1, '2022-03-04 11:26:46', '2022-11-29 02:35:45', NULL),
(19, 'Présentation des travaux de recherche des stagiaires de la première cohorte de stagiaires à Odacesoft', 'presentation-des-travaux-de-recherche-des-stagiaires-de-la-premiere-cohorte-de-stagiaires-a-odacesoft', '-', 'Dans la matinée de ce Mercredi 15 Mars 2022, les stagiaires ayant commencé leur stage le Lundi 14 Mars dernier ont présenté à tour de rôle le fruit de leur recherche dans nos locaux', '<div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">Nos stagiaires ont démarré leur stage ce lundi 14 Mars 2022 dans deux différentes catégories : Développement d\'applications et Design &amp; Communication.</div><div dir=\"auto\" style=\"font-family: inherit;\">Cette cohorte de stagiaires est composée de :</div><div dir=\"auto\" style=\"font-family: inherit;\">1- MAMA GAO Adnane</div><div dir=\"auto\" style=\"font-family: inherit;\">2- MOHOSSOU Raphaël</div><div dir=\"auto\" style=\"font-family: inherit;\">3- MICHONONBO Félicien</div><div dir=\"auto\" style=\"font-family: inherit;\">4- AHOUANVOEKE Caleb</div><div dir=\"auto\" style=\"font-family: inherit;\">5- SAMOU Marwane</div><div dir=\"auto\" style=\"font-family: inherit;\"><span style=\"font-family: inherit;\">Dès le premier jour les filets sont jetés afin de les apprendre à pêcher.</span><br></div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">En binôme, ils ont pu présenter le résultat de leur travail.</div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">Des suggestions leur ont été prodiguée afin d\'améliorer la qualité de leur travail en fin de semaine.</div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">Odacesoft, pour créer des possibilités ! <span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\" style=\"margin: 0px 1px; height: 16px; width: 16px; display: inline-flex; vertical-align: middle; font-family: inherit;\"><img height=\"16\" width=\"16\" alt=\"❤️\" referrerpolicy=\"origin-when-cross-origin\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tf3/1.5/16/2764.png\" style=\"border-style: initial; border-color: initial;\"></span></div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><br></div>', 1, 'storage/uploads/activites/47780_page.jpg', 23, 1, 1, '2022-03-19 15:02:15', '2022-11-04 00:30:36', NULL),
(20, 'Les Wikipédiens en collaboration avec Odacesoft, l\'association JeVeuxBriller et Shinenation organisent une formation sur la création de contenus sur Wikipédia à Parakou', 'les-wikipediens-en-collaboration-avec-odacesoft-lassociation-jeveuxbriller-et-shinenation-organisent-une-formation-sur-la-creation-de-contenus-sur-wikipedia-a-parakou', '-', 'Dans le cadre du mois international de la contribution 2022,  les Wikipédiens rejoignent Parakou pour aider la communauté à s\'approprier du Grand encyclopédie qu\'est Wikipédia.', '<p>Les Wikipédiens en collaboration avec Odacesoft, l\'association JeVeuxBriller et Shinenation&nbsp; organise :</p><p>✅ LE MOIS INTERNATIONAL DE LA CONTRIBUTION 2022 AU BÉNIN 🇧🇯</p><p>A cet effet, une séance de de formation sera organisée le 19 mars 2022 dans les locaux de Shinenation à Parakou.</p><p>Rejoins-nous à Parakou ce samedi 19 Mars 2022 pour apprendre et comprendre les coulisses de Wikipédia, l\'encyclopédie collaborative.&nbsp;</p><p>Voici le lien d\'Inscription&nbsp;</p><p>👉 https://bit.ly/3vVCTgA</p><p>✅ La Date limite pour les inscriptions est fixée au 17 mars 2022 à 23H 59.&nbsp;</p><p>Pour plus de renseignement, contactez par WhatsApp au numéro suivant :</p><p>☎️ http://wa.me/22997298054</p><p>P*artager avec vos contacts et amis.&nbsp;</p><p>#Odacesoft #Wikipedia #Wikimediens #Parakou</p>', 1, 'storage/uploads/activites/25451_1647707382_page.jpg', 12, 1, 1, '2022-03-19 15:29:42', '2022-11-07 09:04:45', NULL);
INSERT INTO `activites` (`id`, `title`, `slug`, `statut`, `lead`, `content`, `temps`, `img`, `view_count`, `user_id`, `actif`, `created_at`, `updated_at`, `deleted_at`) VALUES
(21, 'Visite du personnel de l\'Agence Belge pour le Développement Enabel dans nos locaux', 'visite-du-personnel-de-lagence-belge-pour-le-developpement-enabel-dans-nos-locaux', '-', 'Enabel est une organisation qui oeuvre au bénin dans plusieurs secteurs à travers plusieurs projets. Dans le cadre du projet DigiBoost dont bénéficie Odacesoft, une visite a été effectuée ce Jeudi 17 Mars 2022', '<p>Nous avons reçu la visite dans la soirée du Jeudi 17 Mars dernier nos partenaires de l\'Agence Belge pour le développement Enabel. Cette visite entre dans le cadre du Bilan des activités du projet DigiBoost.</p><p><br></p><p>Nous avons eu des discussions autour du Projet #DigiBoost dont vous avons bénéficié avec pour objectif de révéler ce qui a le plus marché et ensuite faire des observations dont il faut tenir compte à l\'avenir.</p><p><br></p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"275991006_1869929159858037_2121824275318921473_n.jpg\"><br></p><p>On a également parlé de comment Odacesoft pourrait désormais se positionner afin de mettre son savoir faire à la disposition de jeunes entrepreuneurs du Bénin en général et en particulier du Nord Bénin.</p><p><br></p><p><a href=\"https://www.facebook.com/Odacesoft/\" target=\"_blank\">Rejoingnez nous sur facebook</a> et Abonnez-vous pour en savoir plus sur nos prochaines activités.</p><div><br></div>', 2, 'storage/uploads/activites/29434_1647708202_page.jpg', 26, 1, 1, '2022-03-19 15:43:22', '2022-12-05 01:10:20', NULL);
INSERT INTO `activites` (`id`, `title`, `slug`, `statut`, `lead`, `content`, `temps`, `img`, `view_count`, `user_id`, `actif`, `created_at`, `updated_at`, `deleted_at`) VALUES
(22, 'Formation des Wikimédiens à Parakou, un paris gagné pour Odacesoft, Shinenation et l\'association #JEVEUXBRILLER', 'formation-des-wikimediens-a-parakou-un-paris-gagne-pour-odacesoft-shinenation-et-lassociation-jeveuxbriller', '-', 'Une formation sur la création de contenus sur Wikipédia a été organisée à Parakou le 19 Mars dernier dans les locaux de Shinenation. Plus de 20 participants ont répondus présents à ce rendez-vous.', '<p>A l’occasion du mois international de la contribution 2022 au Bénin, la communauté Wikimédienne a organisé ce&nbsp; samedi 19 mars 2022 à Parakou, un&nbsp; atelier de formation sur la création de contenus sur Wikipédia en partenariat avec Odacesoft et d\'autres acteurs de l\'écosystème Numérique de Parakou comme L\'association #JeVeuxBriller et #Shinnation. Une vinghtaine de participants&nbsp; ont participé à la séance&nbsp; de formation qui a eu lieu à Shinnation et animée par 04 formateurs.</p><p><br></p><p>Au cours de cette formations, plusieurs notions ont été apportées aux participants :&nbsp;</p><ul><li>Qu’est-ce que Wikipédia ;</li><li>les principes de Wikipédia ;</li><li>les projets neuf de Wikipédia et comment contribuer à Wikipédia ;</li><li>Etc.</li></ul><p>Des exercices pratiques ont été attribué à quelques participants vers la fin pour faire connaitre (par modification et ajout sur Wikipédia) certains quartiers de Parakou.</p><p><br></p><p>L’atelier a permis aux participants de pouvoir s’intéresser à ce réseau de contributeurs, amsi aussi pour découvrir plusieurs fonctionnalités du plus grand encyclopédie libre que représente Wikipédia.</p><p><br></p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"WhatsApp Image 2022-03-19 at 12.33.30 PM.jpeg\"><br></p><p><br></p><p> Désormais grâce à l’atelier, Wikipédia ne sera plus considéré seulement\ncomme application de recherche d’information mais aussi comme une\noccasion de faire découvrir au monde des choses sur mon Pays ou ma ville\nafin de contribuer à Wikipédia . L\'essentiel a été donné aux participants afin d\'être de véritables contributeurs et ainsi éviter certaines erreurs qui\npourraient facilement faire annuler leurs publications sur Wikipédia.</p><p>Des séances de formations seront organisées dans les prochains mois afin de péréniser l\'acquis et de développer la communauté des Wikimédiens dans la ville de Parakou.</p><p><br></p><p>Pour débuter votre aventure de contributeur sur Wikipédia cliquez ici :&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Aide:Débuter\" target=\"_blank\">https://fr.wikipedia.org/wiki/Aide:Débuter</a></p>', 3, 'storage/uploads/activites/61548_page.jpg', 67, 1, 1, '2022-03-21 14:57:08', '2022-12-11 09:17:23', NULL);
INSERT INTO `activites` (`id`, `title`, `slug`, `statut`, `lead`, `content`, `temps`, `img`, `view_count`, `user_id`, `actif`, `created_at`, `updated_at`, `deleted_at`) VALUES
(23, 'Participation au Camp d’immersion de langue Anglaise à  Bohicon du 20 au 25 Mars 2022', 'participation-au-camp-dimmersion-de-langue-anglaise-a-bohicon-du-20-au-25-mars-2022', '-', 'Nous avons participé du 20 au 25 Mars 2022 au Camp d’immersion de langue Anglaise à  Bohicon. Ce Camp a été organisé par l’Agence Belge pour le développement Enabel et exécuté par Language Lab dans le cadre du projet Digiboost.', '<p>Démarré le lundi 21 Mars 2022,&nbsp; les activités du&nbsp;&nbsp;Camp d’immersion de langue Anglaise<span \"=\"\">&nbsp;mission ont consisté à&nbsp;</span><span style=\"\">une séance de valication de la plateforme de vulgarisation des structures d’accompagnement à l’entreprenariat innovant au Bénin (www.digiboost.com) qui a eu lieu dans la journée du 21 Mars 2022. Le reste des jjours de cet atelier a été consacré au&nbsp;</span>&nbsp;Camp d’immersion de langue Anglaise.</p><p>C\'était à l’Hôtel « Le Prince » de Bohicon qu\'a lieu les&nbsp; 5 jours d\'activité de cet atelier. La<span style=\"font-family: var(--x-font-sans-serif); font-size: 1rem;\">&nbsp;plateforme validée a été conçue l’année dernière et avait reçue des suggestions et recommandations, lesquelles ont été prises en compte avant la présentation. Dans la soirée de ce Lundi 21 Mars, il a été demandé aux participants de se connecter aux différents comptes afin de remplir les différentes informations relatives aux comptes crées. Nous nous sommes donc connecter au compte Odacesoft afin de renseigner les informations nécessaires (logos, nom, devise, objectifs, mission, vision, etc.). Cette page est disponible à l\'adresse suivante :&nbsp;</span><a href=\"https://digiboost.bj/fr/details-organisation?id=2LGQD3GErP\" target=\"_blank\">https://digiboost.bj/fr/details-organisation?id=2LGQD3GErP</a></p><p><span style=\"font-family: var(--x-font-sans-serif); font-size: 1rem;\"><br></span></p>\r\n<p>Les activités du camp d’Anglais ont proprement démarrées le lendemain à partir de 9heures. Après une séance de révision, le reste des ateliers nous a permis d’aborder plusieurs notions à travers :</p><p>-<span style=\"white-space:pre\">	</span>des tongues twisters (exercice de prononciation)</p><p>-<span style=\"white-space:pre\">	</span>les temps en Anglais (present simple/past simple, present perfect/past perfect, futur continuous/past continuous,…)</p><p>-<span style=\"white-space:pre\">	</span>Business English</p><p>-<span style=\"white-space:pre\">	</span>Singing (Chant)&nbsp;</p><p><br></p><p>Une évaluation a été effectuée le troisième jour (Jeudi 24 Mars) afin d’évaluer le niveau des apprenants.&nbsp;</p><p>La matinée de la dernière journée a été consacrée à l’avis des participants sur la formation et à des séances de chant (singing).</p><p>Aux environs de 13 heures, la responsable du projet DigiBoost s’est exprimée par rapport au déroulement du camp et de l’activité de la formation en générale. C’était également l’occasion pour nous les participants de remercier Enabel et Language Lab pour l’effort fourni afin que les structures d’accompagnement puisse bénéficier de ce programme de langue qui sans doute a permis d’améliorer considérablement le niveau de chaque participant en Anglais.</p><p>L’atelier de travail a pris fin aux environs de quatorze heures avec une photo de famille à la grande satisfaction de tous les participants.</p><p>Les photos de l\'activités sont disponibles ici :&nbsp;<a href=\"https://flic.kr/s/aHBqjzHjVE\" target=\"_blank\">https://flic.kr/s/aHBqjzHjVE</a><a href=\"https://flic.kr/s/aHBqjzHjVE\" target=\"_blank\"></a></p><p><br></p>\r\n<iframe frameborder=\"0\" allowfullscreen=\"\" class=\"flickr-embed-frame\" webkitallowfullscreen=\"\" mozallowfullscreen=\"\" oallowfullscreen=\"\" msallowfullscreen=\"\" width=\"1024\" height=\"768\" data-natural-width=\"1024\" data-natural-height=\"683\" style=\"overflow: hidden; padding: 0px; margin: 0px; width: 100%; height: 768px; max-width: none;\" data-loaded=\"true\"></iframe><script async=\"\" src=\"//embedr.flickr.com/assets/client-code.js\" charset=\"utf-8\"></script>', 3, 'storage/uploads/activites/15777_1648942096_page.jpg', 56, 1, 1, '2022-04-02 21:28:16', '2022-12-06 12:30:50', NULL);
INSERT INTO `activites` (`id`, `title`, `slug`, `statut`, `lead`, `content`, `temps`, `img`, `view_count`, `user_id`, `actif`, `created_at`, `updated_at`, `deleted_at`) VALUES
(24, 'Participation à l\'atelier de validation de la feuille de route 2022-2023 de la Fédération des SAEI du Benin', 'participation-a-latelier-de-validation-de-la-feuille-de-route-2022-2023-de-la-federation-des-saei-du-benin', '-', 'Du Lundi 18 au Vendredi 22 Avril 2022, nous avons participé à un atelier de travail à Bohicon dans le cadre des activités de Fédération des Structures d\'Accompagnement à l\'Entreprenariat Innovants du Bénin', '<p>Démarré le Lundi aux environs de 9 heures, l\'atelier de travail inititié par la Fédération des SAEI (<span style=\"font-family: var(--x-font-sans-serif); font-size: 1rem;\">FedSAEI)&nbsp;</span><span style=\"font-family: var(--x-font-sans-serif); font-size: 1rem;\">et porté par le Projet DibiBoost de Enabel Bénin a permi aux acteurs de l\'écosystème de l\'accompaganement en entreprenariat du Bénin de mener un ensemble d\'activité afin de mettre en oeuvre leur programme de travail annuel.</span></p><p>Cet atelier&nbsp; regroupe environ 36 Structures d’Accompagnement à l’Entrepreunariat Innovant (SAEI) répartis à travers tout le Bénin.&nbsp;<span style=\"font-family: var(--x-font-sans-serif); font-size: 1rem;\">L’objectif de cet atelier est d’élaborer une feuille de route annuelle 2022-2023 et d’approuver la convention cadre entre la Fédération et DigiBoost.</span></p><p>Plus spécifiquement, il est attendu lors de cet atelier les éléments suivants :&nbsp;</p><ul><li>Définir clairement les actions et activités à mener pour l’enregistrement officiel de la Fédération ;</li><li><span style=\"font-family: var(--x-font-sans-serif); font-size: 1rem;\">Décliner les actions, les responsables, le timing, activités à mener durant l’année 2022 ;</span></li><li><span style=\"font-family: var(--x-font-sans-serif); font-size: 1rem;\">Amender et approuver la convention cadre FedSAEI et DigiBoost</span></li></ul><p><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"IMG-20220421-WA0063.jpg\"><br></p><p><br></p><p>Présidé par le Bureau de la FedSAEI composé<span style=\"font-family: Montserrat; font-size: 12pt;\">&nbsp;de 7 membres du Conseil d’Administration (CA) et de 3\r\nCommissaires au compte, l\'atelier a permit au bout des 4 jours de travail d\'accoucher un PTA validé par l\'ensemble des acteurs présents après quelques amendements.</span></p><p><span style=\"font-family: Montserrat; font-size: 12pt;\">C\'était aussi l\'occation pour la FedSAEI de discuter des enjeux du premier mandat qui sera déterminant dans l\'avenir des SAEI Béninoise.&nbsp;</span></p><p><span style=\"font-family: Montserrat; font-size: 12pt;\">Le FedSAEI a proité de l\'occasion pour proposer et adopter une convention de collaboration entre elle et DigiBoost.</span></p><div>Il faut rappeler que la séance de travail au eu lieu à l\'Hôtel des Princes de Bohicon en présences des mebres de la FedSAEI et du projet DigiBoost.</div>', 3, 'storage/disk/activites/73847_1651345223_page.jpg', 21, 1, 1, '2022-04-30 17:00:23', '2022-11-11 16:03:29', NULL);
INSERT INTO `activites` (`id`, `title`, `slug`, `statut`, `lead`, `content`, `temps`, `img`, `view_count`, `user_id`, `actif`, `created_at`, `updated_at`, `deleted_at`) VALUES
(25, 'Forum sur l\'Intelligence Artificielle : Un pari gagné pour Odacesoft', 'forum-sur-lintelligence-artificielle-un-paris-gagne-pour-odacesoft', '-', 'Le forum sur l’intelligence artificielle orgénisé par Odacesoft s’est déroulé du 27 au 28 mai 2022 dans les locaux de Odacesoft à Parakou avec la participation de différents pays.', '<p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px;\">Les deux journées du Forum sur l\'Intélligence Artificielle ont permis aux participants d’échanger et discuter sur leur expériences et connaissances diverses dans leurs pratiques quotidiennes en ce qui concerne l’intelligence artificielle.&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px;\">L’objectif du forum est de créer un cadre d’échange sur les enjeux et problématiques liés à l’intelligence artificielle et de mettre en place une communauté constituée des passionnés de l’IA.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px;\">Les participants à ce forum sont plus de 80 personnes ; de formation académiques et expériences professionnelles différentes. Certains d’entre eux sont à leurs premières expériences en matière d’échange sur l’intelligence artificielle tandis que d’autres ont été déjà impliqués dans les réflexions sur l’intelligence artificielle. Tous les participants étaient dans les dispositions d’échanger et de débattre sur les outils et pratiques indispensables dans le développement de l’IA à travers les technologies associées (Machine Learning, Deep Learning, …).</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px;\">Au total 7 communications et une table ronde ont meublées ces deux jours qu’a duré ce forum avec une implication, une participation dynamique et un intérêt manifeste des participants. Il y a eu sur toutes les thématiques développées beaucoup d’échanges et de partages entre communicateurs et participants. La méthodologie d’approche et la pédagogie utilisée pour véhiculer les informations sont simple et accessibles à l’ensemble des participants. Ces derniers n’ont pas manqué à poser d’ailleurs beaucoup de questions qui ont suscité des débats intéressants.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"WhatsApp Image 2022-05-30 at 8.48.17 PM.jpeg\"><br></p><p class=\"MsoNormal\" style=\"text-align: center;\"><span style=\"font-size: 18.6667px;\"><i>[Capture d\'écran de l\'une des communications en ligne]</i></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px;\">La clarté des explications et les répétitions surtout au moment de la présentation de synthèse de l’évaluation journalière des activités déroulées ont beaucoup facilité la compréhension et la maitrise des séances. La synthèse des différentes évaluations confirme que les objectifs fixés dans le cadre de ce forum sont atteints, de même que les attentes des participants sont couvertes et satisfaites.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px;\">A l’unanimité, tous les participants ont salué et approuvé la démarche participative suscitée tout au long de l’évènement.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px; font-family: var(--x-font-sans-serif);\">Plusieurs notions ont été donc apportées aux participants à travers plusieurs communications dirigé par des communicateurs sur les thématiques suivantes :</span><br></p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><ul><li style=\"text-align: justify;\"><span style=\"font-size: 18.6667px;\"><b>Prédiction des débits sur le bassin de l’ouémé, à savè avec le deep learning</b> ; Communicateur : Pierre Jérôme ZOHOU</span></li><li style=\"text-align: justify;\"><span style=\"font-size: 18.6667px;\"><b>Importance du Big Data pour révolutionner l’IA en Afrique</b> ; Communicateur : Osias Noël TOSSOU</span></li><li style=\"text-align: justify;\"><span style=\"font-size: 18.6667px;\"><b>Apprentissage automatique et diagnostique précoces des maladies non transmissibles au Bénin : cas des personnes âgées atteintes de l’AVC</b> ; Communicateur : Mohamadou SALIFOU</span></li><li style=\"text-align: justify;\"><span style=\"font-size: 18.6667px;\">&nbsp;<b>L’intelligence artificielle au service de la mobilité urbaine au Bénin</b> ; Communicateur : Bruno BIO NIKKI</span></li><li style=\"text-align: justify;\"><span style=\"font-size: 18.6667px;\"><b>L’intelligence artificielle au service du secteur de l’assurance</b> ; Communicateur : Brice OBOKINI &amp; Bernadin LIGAN</span></li><li style=\"text-align: justify;\"><span style=\"font-size: 18.6667px;\"><b>Outils et Techniques de création d’un modèle de Maching Learning</b> ;Communicateur : Wahabou K. TABA CHABI</span></li><li style=\"text-align: justify;\"><span style=\"font-size: 18.6667px;\"><b>Intelligence Artificielle et le Machine Learning : Quelle Bénéfice pour l’Agriculture</b> ; Communicateur : Aurel TCHOKPONHOUE &amp; Désiré SIMPEREGUI</span></li><li style=\"text-align: justify;\"><span style=\"font-size: 18.6667px;\"><b>Table RONDE</b> : Quelle contribution de l’IA au développement économique de l’Afrique;&nbsp;</span>Invités : Mickaël MOUSSE, M. Géraud AIHONNOU, Gilles ATIGOSSOU.</li></ul><p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify\"><span style=\"font-size:14.0pt;line-height:107%;mso-bidi-font-family:Calibri;\r\nmso-bidi-theme-font:minor-latin;color:black\">&nbsp;</span></p><table class=\"table table-bordered\"><tbody><tr><td><b>PAYS&nbsp; DES PARTICIPANTS</b></td><td><b>NOMBRE</b></td></tr><tr><td>Bénin</td><td>70</td></tr><tr><td>Mali</td><td>2</td></tr><tr><td>Sénégal</td><td>2</td></tr><tr><td>Ghana</td><td>1</td></tr><tr><td>Suisse</td><td>1</td></tr><tr><td>Maroc</td><td>4</td></tr><tr><td>Tchad</td><td>1</td></tr><tr><td>Caméroun</td><td>1</td></tr><tr><td>France</td><td>2</td></tr></tbody></table><p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px; font-family: Calibri, sans-serif;\"><br>L’indisponibilité de certains communicateurs et la coupure de l’électricité n’ont pas facilité les choses et ont entachés le bon déroulement des activités. </span></p><p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px; font-family: Calibri, sans-serif;\"><br></span></p><p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px; font-family: Calibri, sans-serif;\">Cependant, la participation active et l’ambiance conviviale et très chaleureuse notées pendant les différentes communications, montrent clairement le grand intérêt que les participants portaient à ce forum. La majorité des participants se dit satisfaite des séances dans la mesure où elle a traité leurs attentes et a permis d’échanger sur différentes thématiques. </span></p><p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px; font-family: Calibri, sans-serif;\">Les participants ont souhaité que cette occasion soit mise en valeur d’avantage et soient organisées souvent des formations de ce genre pour partager les outils.</span><br></p><p class=\"MsoNormal\"><span style=\"font-size:14.0pt;line-height:107%;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin\">&nbsp;</span></p>', 4, 'storage/disk/activites/80803_1654079977_page.jpg', 65, 1, 1, '2022-06-01 08:39:37', '2022-12-01 01:34:00', NULL);

