(1, 'Comment créer sa Startup ?', 'comment-creer-sa-startup', '-', '-', '<div class=\"\" dir=\"auto\"><div class=\"ecm0bbzt hv4rvrfc ihqw7lf3 dati1w0a\" data-ad-comet-preview=\"message\" data-ad-preview=\"message\" id=\"jsc_c_1j\"><div class=\"j83agx80 cbu4d94t ew0dbk1b irj2b8pg\"><div class=\"qzhwtbm6 knvmm38d\"><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Se lancer dans l\'entreprenariat doit être une décision bien mûrie. On ne naît pas entrepreneur, on le devient. </div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Pour\r\n entreprendre, vous devez vous connaître, vos points forts et vos points\r\n faibles. Il est bien plus facile de se lancer dans un domaine que nous \r\nmaîtrisons ou qui est adapté à nos points forts que de se lancer dans \r\nquelque chose que vous ne maitrisez pas du tout. C’est pour cela que je \r\nvais vous demander de lister toutes vos compétences sur un papier, que \r\nce soit des compétences techniques, managériales, sociales, etc.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Il faut ensuite vous poser les bonnes questions: pourquoi souhaitez vous entreprendre ?</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">La réponse à cette question vous aidera tout au long de votre parcours d’entrepreneur.</div><div dir=\"auto\" style=\"text-align: start;\">En\r\n plus de cette question, vous devez être prêt psychologiquement à \r\naffronter vos peurs et à tout donner afin de combler les aspects dans \r\nlesquels vous ne vous sentez pas trop doué et qui vous aideront à être \r\nun bon entrepreneur.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"💥\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t40/1/16/1f4a5.png\" width=\"16\" height=\"16\"></span> CHOISISSEZ UN DOMAINE PORTEUR D’AVENIR </div><div dir=\"auto\" style=\"text-align: start;\">Être\r\n entrepreneur, c’est être à l\'affût de l’information, du besoins qu’il \r\npeut y avoir dans votre environnement afin d’y apporter une solution. \r\nS’il existe une solution que les gens pensent être meilleure, c’est à \r\nvous de penser au-delà pour prouver qu’on peut faire mieux. C’est de là \r\nque naît l’innovation. </div><div dir=\"auto\" style=\"text-align: start;\">Être\r\n à l\'affût de l’information, c’est aussi savoir ce qui va demain être \r\nutile ou à la mode, c’est de voir demain avant qu’il n’arrive, c’est \r\nprévoir une solution à un problème imminent ou futur.</div><div dir=\"auto\" style=\"text-align: start;\">Étant\r\n donné que vous connaissez vos points forts et vos points faibles, il \r\nvous faut vous tourner vers un domaine qui cadre avec vos points forts \r\net plus spécifiquement sur un domaine spécifique dans lequel vous \r\nsouhaitez avoir une expertise afin de résoudre les problèmes qui se \r\nprésenteront sur votre chemin.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"💥\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t40/1/16/1f4a5.png\" width=\"16\" height=\"16\"></span> TROUVEZ L\'IDÉE DU SIÈCLE </div><div dir=\"auto\" style=\"text-align: start;\">Avant\r\n d’être un entrepreneur, vous êtes un consommateur des produits des \r\nautres entrepreneurs. Votre insatisfaction par rapport à un ou plusieurs\r\n de ces produits peut constituer un projet ou une idée de startup à \r\nmûrir. Vous pouvez vous poser la question de savoir pourquoi vous \r\nchoisiriez tel produit au lieu de tel autre?</div><div dir=\"auto\" style=\"text-align: start;\">Partout\r\n où vous avez, des idées peuvent vous venir à la tête, je vous conseille\r\n d’avoir un carnet afin de noter tout ce qui pourrait vous passer à la \r\ntête comme idée de projet.</div><div dir=\"auto\" style=\"text-align: start;\">Vous\r\n pourrez au calme faire une élimination afin de retenir celui qui selon \r\nvous respecte les critères de startup dont nous avons parlé que sont:</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"✅\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" width=\"16\" height=\"16\"></span> l’innovation</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"✅\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" width=\"16\" height=\"16\"></span> la perspective d’une forte croissance</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"✅\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" width=\"16\" height=\"16\"></span> la création ou l\'utilisation d\'une technologie nouvelle</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"✅\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" width=\"16\" height=\"16\"></span> le besoin d\'un financement massif</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"💥\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t40/1/16/1f4a5.png\" width=\"16\" height=\"16\"></span>TESTEZ VOS IDÉES </div><div dir=\"auto\" style=\"text-align: start;\">Une\r\n fois l’idée trouvée, il vous faut la tester auprès de votre clientèle \r\nou à travers des appels à projet afin de juger de l’importance ou de \r\nl’acceptation de ce dernier auprès de votre clientèle ou du public \r\ncible. C’est donc le moment de réaliser un mockup (ou prototype) afin \r\nd’avoir un aperçu sur ce à quoi pourrait ressembler votre produit final.\r\n Vous pouvez également réaliser des enquêtes afin d’avoir l’avis des uns\r\n et des autres sur votre projet. Vous devez savoir qu’une idée ne vaut \r\nrien si elle ne sert à personne.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"💥\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t40/1/16/1f4a5.png\" width=\"16\" height=\"16\"></span> LANCEZ VOUS </div><div dir=\"auto\" style=\"text-align: start;\">On\r\n n\'est jamais prêt pour démarrer une affaire. On se lance dans les \r\naffaires pour résoudre des problèmes et aussi pour se faire de l’argent \r\nsi votre idée semble être géniale et qu’elle ne vous permettra pas dans \r\nle long terme de gagner de l’argent, il va falloir encore y penser avant\r\n de vous lancer.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">La grande question qu\'on se pose souvent est de savoir comment avoir mon premier produit et générer mes premiers revenus ?</div><div dir=\"auto\" style=\"text-align: start;\">Si\r\n vous arrivez à résoudre ce challenge, il suffira de se donner de \r\nnouveaux challenges chaque jour afin de faire grandir votre entreprise.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Pour\r\n partager les risques, certains recommandent de se lancer à plusieurs \r\nafin que vous soyez épaulé par vos collègues afin de relever les défis \r\nqui se présenteront sur votre chemin.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">On\r\n peut devenir riche en entreprenant mais on entreprend pas parce qu\'on \r\nveut devenir riche rapidement. C’est une décision à mûrir avant de s’y \r\nlancer.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Et vous, êtes vous prêt pour lancer votre startup ?</div><div dir=\"auto\" style=\"text-align: start;\">Dites moi, à quelle étape êtes vous et comment pourrais- je vous aider.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span></span><span><br></span></div></div></span></div></div></div></div>', '-', NULL, 11, 1, 1, 1, 1, '2021-10-29 06:26:52', '2022-10-25 16:28:18', NULL),
(2, 'C\'est quoi une Startup ?', 'cest-quoi-une-startup', '-', '-', '<div dir=\"auto\" style=\"text-align: start;\">Aujourd’hui, nous allons parler d’un mot dont vous avez certainement entendu parler une, deux ou plusieurs fois.</div><div dir=\"auto\" style=\"text-align: start;\">De quoi parle ton quand on parle de Startup.</div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"💥\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t99/1.5/16/1f4a5.png\" width=\"16\" height=\"16\"></span> L’ORIGINE DU MOT</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Une start-up encore appelée jeune pousse ou entreprise en démarrage. En d\'autres termes, c\'est une entreprise innovante nouvellement créée, généralement à la recherche d\'importants fonds d\'investissement, avec un très fort potentiel éventuel de croissance économique et de spéculation financière sur sa valeur future. (Wikipédia)</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"💥\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t99/1.5/16/1f4a5.png\" width=\"16\" height=\"16\"></span> DE QUOI S\'AGIT IL, DANS LA PRATIQUE ? </div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Dans la pratique, une Startup est une entreprise. Mais pas une entreprise à part entière. Il s’agit d’une \"entreprise qui démarre\". Elle est liée à la notion d’expérimentation d\'une nouvelle activité, sur un nouveau marché, avec un risque difficile à évaluer.  Ces types d’entreprises sont souvent à la recherche d’un business Modèle, c\'est-à -dire un moyen de générer de l’argent avec leurs activités actuelles.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"💥\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t99/1.5/16/1f4a5.png\" width=\"16\" height=\"16\"></span> CRITÈRES À REMPLIR POUR ÊTRE UNE STARTUP </div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Il doit remplir selon sa définition un certain nombre de critères:</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"✅\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tba/1.5/16/2705.png\" width=\"16\" height=\"16\"></span> l’innovation</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"✅\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tba/1.5/16/2705.png\" width=\"16\" height=\"16\"></span> la perspective d’une forte croissance</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"✅\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tba/1.5/16/2705.png\" width=\"16\" height=\"16\"></span> la création ou l\'utilisation d\'une technologie nouvelle</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"✅\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tba/1.5/16/2705.png\" width=\"16\" height=\"16\"></span> le besoin d\'un financement massif</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"💥\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t99/1.5/16/1f4a5.png\" width=\"16\" height=\"16\"></span> UNE STARTUP, UNE ENTREPRISE FRAGILE</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Le caractère innovant sur lequel se base l’offre de la startup et  son modèle économique(sa façon de gagner de l’argent) ne permet pas de définir clairement toutes les composantes de son marché et de lui assurer une rentabilité immédiate. C’est pour cela qu’on parle de risque élevé. Cela veut dire qu’au cours de la phase d’expérimentation, l’entreprise peut faire faillite et abandonner le projet.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Au terme de la phase d’expérimentation, la startup :</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"⭕\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tc0/1.5/16/2b55.png\" width=\"16\" height=\"16\"></span> devient une entreprise traditionnelle avec un modèle économique établi (Google, Facebook, AirBnb,GoZem,...)</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"⭕\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tc0/1.5/16/2b55.png\" width=\"16\" height=\"16\"></span> ou est absorbée par une entreprise plus grande(c’est le cas de plusieurs entreprises: WhatsApps et Instagram tous rachetés par Facebook, LinkedIn racheté par Microsoft, Twitch racheté par Amazone, …)</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"⭕\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tc0/1.5/16/2b55.png\" width=\"16\" height=\"16\"></span> ou disparaît par manque de trésorerie (Faillite).</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"💥\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t99/1.5/16/1f4a5.png\" width=\"16\" height=\"16\"></span> COMMENT LANCER MA STARTUP ? </div><div dir=\"auto\" style=\"text-align: start;\">Souhaitez-vous lancer une startup, si la réponse est OUI, nous allons découvrir demain comment le faire.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Excellente nuit à tous.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span><br></span></div></div>', '-', NULL, 38, 1, 1, 1, 1, '2021-10-29 07:42:33', '2022-12-07 20:49:27', NULL);

