(7, 'Conception de logiciels', 'storage/disk/categorie-services/conception-de-logiciels_812958.PNG', NULL, 'Pour un meilleur suivi des activités de votre entreprises, vous avez besoin d\'un logiciel pour sa gestion.', 'conception-de-logiciels', '<p>Nous sommes spécialisé dans la conceptions de logiciels de Gestions, de Comptabilité, de Gestion des ressources Humaines, etc.</p><p><br></p>', 0, 1, 1, '2021-09-07 07:58:20', '2021-09-07 09:25:53'),
(8, 'Applications Web et Mobiles', 'storage/disk/categorie-services/applications-web-et-mobiles_890764.PNG', NULL, 'Pour être plus proche de vos clients, la mise en place d\'un site web ou d\'une application mobile vous sera d\'une grande utilité.', 'applications-web-et-mobiles', 'Notre expertise vous séduira des les premières expériences. Saisissez l\'occasion de vous ouvrir au monde dès maintenant.<br>', 0, 1, 1, '2021-09-07 08:01:19', '2021-09-07 08:01:19'),
(9, 'Design numérique', 'storage/disk/categorie-services/design-numerique_184921.PNG', NULL, 'Rendre attrayant vos activités, produits et services est la base pour convaincre vos clients de la qualité de vos prestations.', 'design-numerique', 'Nous sommes disposé à vous aider dans la mise en places des visuels de qualité qui assure une meilleure image de marque de votre structure ou de vos produits<br>', 0, 1, 1, '2021-09-07 08:04:50', '2021-09-07 08:04:50'),
(10, 'Marketing et Com. Digitale', 'storage/disk/categorie-services/marketing-et-com-digitale_702535.PNG', NULL, 'Pour grandir vous devez savoir vendre. Le meilleur moyen de vendre sur Internet est la mise en place d\'une bonne communication digitale et d\'un plan Marketing rentable.', 'marketing-et-com-digitale', 'La bonne nouvelle est que vous pouvez faire plus de ventes que d\'habitude grâce au Marketing digitale. Pour ne pas perdre de l\'argent, nous sommes disposé à vous accompagner.<br>', 0, 1, 1, '2021-09-07 08:09:39', '2021-09-07 08:09:39'),
(11, 'Intallation réseaux', 'storage/disk/categorie-services/intallation-reseaux_288434.PNG', NULL, 'Pour optimiser les ressources  (ordinateurs, imprimantes, logiciels, caméras,...) dont vous disposez, la mise en place d\'un réseau informatique peut vous être très utile', 'intallation-reseaux', 'Vous allez pouvoir optimiser vos ressources en mettant en place un réseaux informatique adapté à vos besoins. Nous vous assurons l\'installation et le bon fonctionnement de votre réseaux existant et future.<br>', 0, 1, 1, '2021-09-07 08:18:42', '2021-09-07 09:25:21'),
(12, 'Expertise et Formation', 'storage/disk/categorie-services/expertise-et-formation_777534.PNG', NULL, 'Monter en compétence vous permet d\'atteindre vos objectifs rapidement. Nous sommes disposé à vous former et à vous conseiller dans vos prises de décisions dans le numérique.', 'expertise-et-formation', '<p>Vous pouvez vous faire former dans les domaines suivants:</p><ol><li>Design Graphique</li><li>Développement d\'applications Web</li><li>Développement d\'applications Mobiles</li><li>Design UI/UX</li><li>R&amp;daction Web<br></li></ol>', 0, 1, 1, '2021-09-07 08:25:28', '2021-09-07 08:25:28');

