INSERT INTO `programmes` (`id`, `title`, `slug`, `resume`, `down_count`, `description`, `img`, `fichier`, `user_id`, `type`, `actif`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Memory2Startup', 'memory2startup', 'Memory2Startup est un programme d\'entreprenariat des jeunes étudiants. L\'objectif est d\'aider les étudiants ayant travaillé sur des mémoires projets de le concrétiser', 0, '<span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id\" dir=\"auto\">Memory2Startup est un programme qui vous aidera à passer à l\'action en concrétisant votre projet de soutenance.<br>- Êtes vous Étudiant ou ancien étudiant ?<br>- Avez-vous entre 18 et 40 ans ? <br>- Avez-vous un thème de Mémoire dans le domaine du Numérique ou qui utilise le numérique dans sa mise en œuvre ? <br><br>PASSER DE L\'IDÉE DE MÉMOIRE À UNE IDÉE D\'ENTREPRISE, CE SERAIT DÉSORMAIS POSSIBLE AVEC <span><a class=\"oajrlxb2 g5ia77u1 qu0x051f esr5mh6w e9989ue4 r7d6kgcz rq0escxv nhd2j8a9 nc684nl6 p7hjln8o kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x jb3vyjys rz4wbd8a qt6c0cv9 a8nywdso i1ao9s8h esuyzwwr f1sip0of lzcic4wl oo9gr5id gpro0wi8 lrazzd5p\" href=\"https://www.facebook.com/hashtag/memory2startup?__eep__=6&amp;__cft__[0]=AZWQHCWQ07P18xAIyLuxqQhfmBB4AjVyB8tgzRFyaXtuz7rB7LwgIK4AgeRoASRewVaNXaUPveDPGWd7x8Z48ozNiXlDLNfm5ubIJyY2uLmkUTPK6msHghD0sleEMPFvhdhXC_3eZE6xAAVT-breLMm8&amp;__tn__=*NK*F\" role=\"link\" tabindex=\"0\">#Memory2StartUp</a></span><br><br>CE PROJET C\'EST POUR VOUS ! <span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"💪\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tc5/1.5/16/1f4aa.png\" width=\"16\" height=\"16\"></span></span>', 'storage/disk/programmes/img_367170.png', NULL, 1, NULL, 1, '2021-11-03 11:56:37', '2022-01-26 08:41:54', NULL),
(2, 'Design Academy', 'design-academy', 'Il s\'agit d\'une formation d\'Initiation au Design Numérique destiné aux jeunes souhaitant apprendre les bases du Design mais également aux personnes âgées.', 0, '<p><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id\" dir=\"auto\">La formation en Design Graphique porte sur la maitrise des règles du Design, la prise en main et le perfectionnement de l\'usage des logiciels de Design comme;</span></p><ul><li><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id\" dir=\"auto\">Adobe Photoshop</span></li><li><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id\" dir=\"auto\">Adobe Illustrator</span></li><li><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id\" dir=\"auto\">Adobe XD</span></li><li><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id\" dir=\"auto\">Adobe Fireworks</span><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id\" dir=\"auto\"></span></li></ul><p><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id\" dir=\"auto\"><br><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"💥\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t99/1.5/16/1f4a5.png\" width=\"16\" height=\"16\"></span> Il s\'agit dune formation deux à 4 semaines pour découvrir les secrets de la conception visuel de type professionnel. <br><br><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"💥\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t99/1.5/16/1f4a5.png\" width=\"16\" height=\"16\"></span> Odacesoft offre un suivi d\'un mois après la période de la formation à tous les participants<br><br><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"✅\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tba/1.5/16/2705.png\" width=\"16\" height=\"16\"></span> Êtes vous prêt pour participer à cette formation ?</span></p><p><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id\" dir=\"auto\"><br></span></p><p><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id\" dir=\"auto\"><b>Inscrivez-vous maintenant !</b><br></span></p>', 'storage/disk/programmes/img_457787.png', NULL, 1, NULL, 1, '2021-11-03 12:17:34', '2022-01-26 08:42:16', NULL),
(3, 'Geek Story', 'geek-story', 'Geek Story est une production audiovisuelle pour faire découvrir le parcours des talents dans le domaine du numérique. Il s\'agit des personnes physiques dont le parcours pourrait inspirer la jeune génération.', 0, '<p>Geek Story a été initié depuis 2019 et compte aujourd\'hui plus de 12 \r\nnuméros. Toutes les vidéos sont disponibles sur notre chaine Youtube : \r\n<a href=\"https://www.youtube.com/channel/UC_A-w6yMj3cMtAVoeXifFBQ\" target=\"_blank\">https://www.youtube.com/channel/UC_A-w6yMj3cMtAVoeXifFBQ</a><br></p>', 'storage/disk/programmes/img_882156.png', NULL, 1, NULL, 1, '2022-01-26 08:51:58', '2022-01-26 08:51:58', NULL),
(4, 'Women In Community Management - WomenInCM', 'women-in-community-management-womenincm', 'WomenInCM est un programme de formation dédié aux filles et aux femmes qui désire apprendre le métier de Community Management afin de gérer leur business ou pour trouver un emploi.', 0, 'La première Edition a permis de former 15 femmes Community Managers. Ce programme est à sa deuxième édition.&nbsp; <br>', NULL, NULL, 1, NULL, 1, '2022-01-26 08:56:05', '2022-01-26 08:56:05', NULL),
(5, 'Spark Dev Academy', 'spark-dev-academy', 'Spark Dev Academy est programme d\'Initiation à la programmation informatique. Les participants apprennent à créer des sites et des applications Web à partir de zéro.', 0, 'Le programme Spark Dev Academy a permis de former une dizaine de jeunes développeurs en 2019. Il s\'agit d\'une formation payante. Nous allons bientôt lancer la deuxième édition à l\'endroit de la communauté<br>', 'storage/disk/programmes/img_175287.jpg', NULL, 1, NULL, 1, '2022-01-26 09:05:59', '2022-01-26 09:05:59', NULL),
(6, 'Projet de Données ouvertes des villes du Bénin - City Open Data', 'projet-de-donnees-ouvertes-des-villes-du-benin-city-open-data', 'Ce projet vise à collecter et rendre accessibles certaines données utiles pour la population. L’objectif pour le long terme de disposer des données fiables pouvant service à une intélligence collective.', 0, 'Le programme City Open Data est encore à sa phase Bêta. La collecte des données est en cours et une plateforme sera mise à disposition dans l\'avenir pour rendre public ces données.<br>', 'storage/disk/programmes/img_677520.jpg', NULL, 1, NULL, 1, '2022-01-26 09:54:42', '2022-01-26 09:54:42', NULL);

