INSERT INTO `realisations` (`id`, `title`, `slug`, `lead`, `img`, `content`, `view_count`, `service_id`, `user_id`, `actif`, `created_at`, `updated_at`) VALUES
(1, 'Affiche pour la communication sur les activités de  l\'évènement Résidences Numériques organisé par Waxangari L@bs', 'affiche-pour-la-communication-sur-les-activites-de-levenement-residences-numeriques-organise-par-waxangari-l-at-bs', 'Nous avons participé à la création des visuels comptant pour la communication sur les activités de la deuxième édition des Résidences Numériques.', './storage/disk/realisations/affiche-po_484793.jpg', '<p>Les résidences Numériques est un évènement de partage, de formation et de promotion de l’entreprenariat Numérique. Cette deuxième édition à eu lieu dans 4 grandes villes du Bénin:</p><ul><li>Parakou</li><li>Bohicon</li><li>Abomey-Calavi et</li><li>Porto-Novo<br></li></ul>', 25, 7, 1, 1, '2022-01-26 20:08:48', '2022-11-21 21:55:32'),
(2, 'Réalisation de visuels sur les cittations de motivation populaires', 'realisation-de-visuels-sur-les-cittations-de-motivation-populaires', 'Nous n\'avons pas tout le temps le moral à 100%. C\'est la raison pour laquelle nous pensons que se motiver au quotidien est un moyen de se recharger pour acommlir encore plus de choses', './storage/disk/realisations/realisatio_345837.jpg', '<p>Nous n\'avons pas tout le temps le moral à 100%. C\'est la raison pour laquelle nous pensons que se motiver au quotidien est un moyen de se recharger pour acommlir encore plus de choses<br></p>', 12, 7, 1, 1, '2022-04-06 08:06:03', '2022-12-10 01:55:12'),
(3, 'Les images de couverture du Magazine Geek Story', 'les-images-de-couverture-du-magazine-geek-story', 'GeekStory est un magazine qui a pour objectif de mettre en lumière les jeunes talents du domaine des TICs. Il s\'agit de jeunes entrepreuneurs, de développeurs, de Designers, etc.', './storage/disk/realisations/les-images_371835.jpg', '<p>GeekStory est un magazine qui a pour objectif de mettre en lumière les jeunes talents du domaine des TICs. Il s\'agit de jeunes entrepreuneurs, de développeurs, de Designers, etc.<br></p>', 14, 7, 1, 1, '2022-04-06 10:37:26', '2022-10-11 16:01:31'),
(4, 'Réalisations de visuels pour le compte de CABRO ENTREPRISE', 'realisations-de-visuels-pour-le-compte-de-cabro-entreprise', 'Dans le but de communiquer sur  son entreprise et son réseau social, Cabro Entreprise nous a sollicité afin de réaliser pour eux quelques visuels', './storage/disk/realisations/realisatio_343289.jpg', '<p>Dans le but de communiquer sur&nbsp; son entreprise et son réseau social, Cabro Entreprise nous a sollicité afin de réaliser pour eux quelques visuels<br></p>', 32, 7, 1, 1, '2022-04-06 10:46:38', '2022-11-19 20:06:21'),
(5, 'Réalisation de visuels pour le compte des journée Doctoriales à l\'EDSAE de l\'Université de Parakou', 'realisation-de-visuels-pour-le-compte-des-journee-doctoriales-a-ledsae-de-luniversite-de-parakou', 'Nous avons réalisé quelques visuels dans le cadre des journées doctoriales en Sciences Agronomiques et de l\'eau pour le compte de l\'EDSAE en 2022', './storage/disk/realisations/realisatio_263553.jpg', '<p>Nous avons réalisé quelques visuels dans le cadre des journées doctoriales en Sciences Agronomiques et de l\'eau pour le compte de l\'EDSAE en 2022<br></p>', 3, 7, 1, 1, '2022-04-06 10:47:05', '2022-08-28 02:56:33'),
(6, 'Visuels de communication du Cabinet de développement personnel DMSW', 'visuels-de-communication-du-cabinet-de-developpement-personnel-dmsw', 'Dans le cadre de ses activités, le Cabinet DMSW (Direct Your Mind on Succès and Wonderful) nous a sollicité afin de faire le relooking de ses affihces pour le compte de sa page Facebook.', './storage/disk/realisations/visuels-de_207884.jpg', '<p>Dans le cadre de ses activités, le Cabinet DMSW (Direct Your Mind on Succès and Wonderful) nous a sollicité afin de faire le relooking de ses affihces pour le compte de sa page Facebook.<br></p>', 5, 7, 1, 1, '2022-04-06 12:27:50', '2022-11-24 13:57:09'),
(7, 'Visuels de communication sur le programme d\'incubation Memory2startup de Odacesoft', 'visuels-de-communication-sur-le-programme-dincubation-memory2startup-de-odacesoft', 'Nous avons réalisé un ensemble de visuels afin de communiquer sur notre programme d\'incubation qui a pour objectif', './storage/disk/realisations/visuels-de_804912.jpg', '<p>Visuels de communication sur le programme d\'incubation Memory2startup de Odacesoft<br></p>', 5, 7, 1, 1, '2022-04-07 05:47:50', '2022-11-17 18:07:56'),
(8, 'Visuels de l\'évènement MANDELA DAY 2020 organisé par l\'association des alumnis du programme YALI Dakar', 'visuels-de-levenement-mandela-day-2020-organise-par-lassociation-des-alumnis-du-programme-yali-dakar', 'Nous avons réalisé en 2020 ces visuels dans le cadre de la communication sur les activités de MANDELA DAY - WODA quia eu lieu à Américan Corner de l\'Université de Parakou.', './storage/disk/realisations/visuels-de_799803.jpg', '<p>Nous avons réalisé en 2020 ces visuels dans le cadre de la communication sur les activités de MANDELA DAY - WODA quia eu lieu à Américan Corner de l\'Université de Parakou.<br></p>', 23, 7, 1, 1, '2022-04-07 07:13:10', '2022-12-11 13:06:33'),
(9, 'Visuels pour pour le compte de l\'Université de Parakou', 'visuels-pour-pour-le-compte-de-luniversite-de-parakou', 'Nous réalisé un ensemble de visuels pour la communication autour de différentes activités', './storage/disk/realisations/visuels-po_683319.jpg', '<p>Nous réalisé un ensemble de visuels pour la communication autour de différentes activités.<br></p>', 23, 7, 1, 1, '2022-04-07 12:29:31', '2022-11-21 21:21:44'),
(10, 'Visuels pour la boutique SAHEL LOOK', 'visuels-pour-la-boutique-sahel-look', 'Nous avons réalsé le visuel pour la devanture de la boutique SAHEL LOOK Parakou', './storage/disk/realisations/visuels-po_827628.jpg', '<p>Nous avons réalsé le visuel pour la devanture de la boutique SAHEL LOOK Parakou<br></p>', 29, 7, 1, 1, '2022-04-07 12:43:58', '2022-12-11 13:06:50'),
(11, 'Visuels de l\'évènement Bénin Apps Month', 'visuels-de-levenement-benin-apps-month', 'Bénin Apps Month est un évènement de promotion des applications Made in Bénin', './storage/disk/realisations/visuel-de-_779654.jpg', '<p>Bénin Apps Month est un évènement de promotion des applications Made in Bénin<br></p>', 24, 7, 1, 1, '2022-04-07 12:49:32', '2022-11-11 16:03:27');

