(2, 'Communication du Directeur de Odacesoft sur les outils de vérification de veille citoyenne face aux intoxications et au non respect de la dignité humaine', 'communication-du-directeur-de-odacesoft-sur-les-outils-de-verification-de-veille-citoyenne-face-aux-intoxications-et-au-non-respect-de-la-dignite-humaine', 'Dans le cadre des activités du YALI NetWork Dakar, le Directeur de Odacesoft Wilfried ETEKA a présenté une communication sur le thème : outils de vérification de veille citoyenne face aux intoxications et au non respect de la dignité humaine', 0, '<p>Voici le contenu de sa présentation<br></p>', 'storage/disk/ressources/img_953573.png', 'storage/disk/ressources/files/ressource_odacesoft_603020.pdf', 1, 'PDF', 1, '2022-02-25 23:34:23', '2022-03-06 15:36:28'),
(3, 'Communicateur de Wilfried ETEKA, Directeur de Odacesoft au Cocktail des Entrepreuneurs à Parakou le 25 Février 2022', 'communicateur-de-wilfried-eteka-directeur-de-odacesoft-au-cocktail-des-entrepreuneurs-a-parakou-le-25-fevrier-2022', 'Découvrez dans ce fichier le contenu de la communication du Directeur de Odacesoft sur la thématique: Importance de communication en entreprise.', 0, '<p>Découvrez dans ce fichier le contenu de la communication du Directeur de Odacesoft sur la thématique: Importance de communication en entreprise.<br></p>', 'storage/disk/ressources/img_360214.jpg', 'storage/disk/ressources/files/ressource_odacesoft_150485.pdf', 1, 'PDF', 1, '2022-02-25 23:45:23', '2022-03-06 15:35:12');

