(6, 'Formation en Initiation au Design Graphique', 'formation-en-initiation-au-design-graphique', NULL, '30.000F', '150.000', 'storage/disk/services/formation-_img_691437.png', NULL, 'Cette formation vous donnes des bases de la création Graphique. Il s\'agira pour vous de maitriser les bonnes pratiques en terme de création de visuels, de logos et de chartes graphiques.', '<p>La formation est plus axée sur la pratique afin de vous aider à maitriser les outils du Design Graphique mis à votre disposition <br></p>', 60, 1, 12, 1, '2021-09-07 10:13:41', '2022-11-23 08:46:40'),
(7, 'Affiche publicitaire', 'affiche-publicitaire', NULL, '10.000F', '80.000F', NULL, NULL, 'Réalisation d\'affiche publicitaire pour valoriser vos produits et services', '<p>Les affiches publicitaires sont les premiers éléments que le clients apprécie avant d\'admirer avant de voir ce que vous lui proposez. Offrez vous un travaille professionnelle pour vous démarquer de la masse. <br></p>', 58, 1, 9, 1, '2021-09-08 23:11:58', '2022-11-10 02:28:44'),
(8, 'Carte de visite', 'carte-de-visite', NULL, '5000F', '15.000F', 'storage/disk/services/carte-de-v_img_705278.jpg', NULL, 'Pour votre prochaine rencontre, ne partez pas sans laisser une bonne impression grâce à votre carte de visite VIP', '<p>Les cartes de visites sont d\'une grande utilité dans la prise de contact et dans le développement des relations.<br></p>', 57, 1, 9, 1, '2021-09-08 23:14:01', '2022-11-22 16:04:08'),
(9, 'Site web victrine', 'site-web-victrine', NULL, '250.000F', '400.000F', 'storage/disk/services/site-web-v_img_693482.jpg', NULL, 'Il s\'agit d\'un site Web pour présenter en quelques pages vos offres de services et produits.', '<p>Ouvrez vous au monde grâce à votre nouveau site web et faites augmenter votre chiffre d\'affaire<br></p>', 56, 1, 8, 1, '2021-09-08 23:15:41', '2022-11-24 13:57:09');

