(5, 'UN LABEL D\'EXPERTISE ET D\'INNOVATION', 'un-label-dexpertise-et-dinnovation-5', 'Nous travaillons à vous offrir le meilleur dont vous avez besoin dans le numérique.', 'storage/disk/slides/un-label-d_slide_1649010330.jpg', '<p><span style=\"color: rgb(255, 255, 255); text-align: center;\">Nous travaillons à vous offrir le meilleur dont vous avez besoin dans le numérique.</span><br></p>', 1, 1, '2022-04-03 14:17:26', '2022-06-03 15:53:55', NULL),
(6, 'DEVENEZ UN DE NOS PARTENAIRES', 'devenez-un-de-nos-partenaires-6', 'Nos partenaires sont ceux qui ont la même vision que nous et qui oeuvrent s\'allient à nous pour l\'atteinte de grands objectifs.', 'storage/disk/slides/devenez-un_slide_1649010314.jpg', '<p>Nos partenaires sont ceux qui ont la même vision que nous et qui oeuvrent s\'allient à nous pour l\'atteinte de grands objectifs.<br></p>', 1, 1, '2022-04-03 14:18:42', '2022-06-03 15:53:50', NULL),
(7, 'NOUS CONCEVONS VOS APPLICATIONS ET SITES WEB', 'nous-concevons-vos-applications-et-sites-web-7', 'Nous avons une expertise avérée dans le domaine de la conception des applications(Web et Mobiles) et des sites Web.', 'storage/disk/slides/nous-conce_slide_1649010291.jpg', '<p>Nous avons une expertise avérée dans le domaine de la conception des applications(Web et Mobiles) et des sites Web.<br></p>', 1, 1, '2022-04-03 14:19:49', '2022-06-03 15:53:43', NULL),
(8, 'NOUS VOUS AIDONS À CONCRÉTISER VOS PROJETS', 'nous-vous-aidons-a-concretiser-vos-projets-8', 'Vous avez une idée innovante, nous vous guidons et vous aidons à la concrétiser.', 'storage/disk/slides/nous-vous-_slide_1649010265.jpg', 'Vous avez une idée innovante, nous vous guidons et vous aidons à la concrétiser.', 1, 1, '2022-04-03 14:20:59', '2022-06-03 16:11:13', NULL),
